(13, '2023-08-28 12:00:24', '2023-11-07 12:44:11', 'SIC BANGKOK-PATTAYA 4D3N 2CANGO', 'SICBKKPTY4D3NF1', 'a:4:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:12:\"ARR- BANGKOK\";s:9:\"deskripsi\";s:72:\"Pick up at the airport, Transfer to check in hotel, Overnight at Bangkok\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:40:\"BANGKOK - PATTAYA BREAKFAST/LUNCH/DINNER\";s:9:\"deskripsi\";s:292:\"Breakfast at Hotel, Honey Bee farm, Great and Grand sweet Destination, Nongnooch Village ( Thai culture show and Elephant Show) Lunch at Nongnooch, Laser Buddha Hill, Visit Erawadee Herb shop, visit Pattaya Floating Market, Pattaya Beach, Dinner at Local restaurant, Check in hotel at Pattaya\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:40:\"PATTAYA - BANGKOK BREAKFAST/LUNCH/DINNER\";s:9:\"deskripsi\";s:297:\"ABF at hotel, Gems gallery Museum of Stone, Back to Bangkok, Dried Food local Product Center, lunch at Local restaurant,\r\nChaophraya River cross by boat to Wat Arun (Temple of Dawn), MBK shopping Mall, Dinner at Local Restaurant, Asia\r\nTique Night Market, transfer to check in hotel at the Bangkok\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:20:\"DEPARTURES BREAKFAST\";s:9:\"deskripsi\";s:52:\"ABF at Hotel, free time until transfer to the airpor\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}}', '- SIC BASIC- TOURIST INSURANCE- FOR GROUP 20 PAX UP PRIVATE ARRAGEMENT WILL BE PROVIDED PLUS FOC 1 TL- 2 NIGHT BANGKOK WITH DAILY BREAKFAST- 1 NIGHT PATTAYA WITH DAILY BREAKFAST- ALL MENTIONED TOURS AND MEALS ON ITINERARY- 1 BOTTLE OF DRINKING WATER PER PERSON DAILY- INDONESIA SPEAKING GUIDE.- VALID APRIL 1, 2023 – OCTOBER 25, 2023- SPECIAL GROUP OFFER, 25 PAX UP DISCOUNT RP 50.000', 'a:1:{i:0;a:3:{s:9:\"exclusion\";s:13:\"TIPPING GUIDE\";s:14:\"exclusion_rate\";s:6:\"310000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}}', NULL, NULL, 'THAILAND'),
(14, '2023-08-28 14:04:34', '2023-11-07 12:44:21', 'SIC AMAZING BANGKOK SHOPPING TOUR 4D3N 2CANGO', 'SICBKKSHP4D3N', 'a:4:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:19:\"DAY 1 ARR-  BANGKOK\";s:9:\"deskripsi\";s:72:\"Pick up at the airport, Transfer to check in hotel, overnight at Bangkok\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:17:\"BANGKOK BREAKFAST\";s:9:\"deskripsi\";s:280:\"Breakfast at Hotel, Honey Bee Farm, Chaophraya River cross by boat to Wat Arun (Temple of Dawn), Lunch By Own at Icon Siam Mall and Sook Siam Market, Wat Pak Nam, Biggest buddha at Bangkok, Gems gallery Museum of Stone, Dinner by Own at Maboonklong (MBK) shopping mall, Back Hotel\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:17:\"BANGKOK BREAKFAST\";s:9:\"deskripsi\";s:186:\"Breakfast at Hotel Erawadee Herb shop, Dried Food, Patinum shopping Mall and Lunch by own , Four Face Buddha, Leather shop, Asia Tique Night Market and Dinner by Own, transfer back hotel\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:20:\"DEPARTURES BREAKFAST\";s:9:\"deskripsi\";s:54:\"ABF at Hotel, free time until transfer to the airport.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}}', 'SIC BASICTOURIST INSURANCE3 NIGHT BANGKOK WITH DAILY BREAKFASTALL MENTIONED TOURS AND MEALS ON ITINERARY1 BOTTLE OF DRINKING WATER PER PERSON DAILYINDONESIA SPEAKING GUIDE.VALID APRIL 1, 2023 – OCTOBER 25, 2023 (SPECIAL PROMOTION! NO SURCHARGE FOR LEBARAN PERIOD!)', 'a:1:{i:0;a:3:{s:9:\"exclusion\";s:13:\"TIPPING GUIDE\";s:14:\"exclusion_rate\";s:6:\"310000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}}', NULL, 'PACKAGE AMAZING BANGKOK SHOPPING TOUR 4D3N SIC 2CANGO EVERYDAY DEPARTURE (2).docx', 'THAILAND'),
(15, '2023-09-01 14:17:27', '2023-12-11 10:46:44', 'BEAUTIFUL NEW KOREA 6D', 'BNKOREA6D', 'a:6:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:36:\"JAKARTA – INCHEON (Meals on Board)\";s:9:\"deskripsi\";s:159:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Incheon Maskapai bintang 5 versi Skytrax.\r\nBermalam di PESAWAT\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:13:\"OZ762 / GA878\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:33:\"INCHEON  - NAMI ISLAND - MT SORAK\";s:9:\"deskripsi\";s:430:\"Setiba di Incheon disambut Guide berbahasa Indonesia yang ramah kemudian kita akan langsung  mengunjungi Italian village atau Ski Resort (Tidak termasuk perlengkapan dan pakaian ski) pada periode Desember-Februari. Dilanjutkan menuju Nami Island yang merupakan tempat syuting “Winter Sonata” serial drama Korea yang mendunia. Dilanjutkan menuju Mt Sorak. Check in hotel istirahat. \r\nBermalam di Sorak I-Park Resort ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:18:\"MT SORAK – SEOUL\";s:9:\"deskripsi\";s:453:\"Sarapan pagi di hotel. Lalu kita akan tour menuju Gunung Sorak mengunjungi Gwangumsung Fortress Hill (termasuk cable car) , Great Bronze Buddha  Statue, Sinheungsa Temple. Setelah selesai kita akan diberi kesempatan untuk mengetahui proses pembuatan rumput laut dan langsung mencicipinya, kita juga akan belajar membuat kimbap, Melewati Cheonggyecheon Stream, Dilanjutkan shopping di Dongdaemun. \r\nBermalam di Golden City Dongdaemun Hotel  *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:15:\"SEOUL CITY TOUR\";s:9:\"deskripsi\";s:729:\"Sarapan pagi di hotel, hari ini kita akan memiliki kesempatan mengunjungi pusat kosmetik local Korea. Hari ini kita juga akan mengunjungi Bukchon Hanok Village. Selanjutnya kita mengunjungi Itaewon Mosque dan dapat shalat sejenak di masjid terkenal di Korea, bagi yang non muslim dapat berjalan-jalan di jalanan Itaewon yang sangat terkenal pada drama “Itaewon Class”. Setelah itu bagi penggemar K-Pop kita akan mengunjungi pusat K-Pop, yaitu COEX Mall, disini kita dapat menikmari panorama perpustakaan di dalam mall yang banyak di kita lihat di film drama korea, Starfield Library dan Gangnam Style Statue. Di malam hari kita akan berbelanja di Hongdae Youth Avenue.\r\nBermalam di Golden City Dongdaemun Hotel  *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:15:\"SEOUL CITY TOUR\";s:9:\"deskripsi\";s:487:\"Sarapan pagi di hotel, kita akan melewati Blue House, kemudian mengunjungi dan akan mencoba menggunakan Hanbok (Baju tradisional korea) di Gyeongbok Palace. Hari ini juga kita akan shopping tour di Amethyst Showcase, Ginseng Center,, Red Pine Shop, Duty Free Shop, hari ini juga kita dapat mengunjungi ikon kota Seoul N Seoul Tower & Love Lock disini ada dapat meletakkan gembok cinta anda disini dan shopping di Myeongdong Street.\r\nBermalam di Golden City Dongdaemun Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:18:\"SEOUL -  JAKARARTA\";s:9:\"deskripsi\";s:214:\"Sarapan pagi, lalu mengunjungi Local Supermarket untuk berbelanja oleh-oleh sebelum ke Incheon Airport. Tiba waktunya  diantar ke Airport untuk kembali ke Jakarta, dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:13:\"OZ761 / GA879\";}}', '✔	 Tiket International Jakarta-Incheon Asiana Airlines/ Garuda Indonesia Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) ✔	Bagasi sesuai dengan 