ngdaemun Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:5:\"SEOUL\";s:9:\"deskripsi\";s:521:\"Sarapan pagi di hotel, kita akan mengunjungi National Gingseng Museum, dilanjutkan ke K-Cosmetic Shop. Hari ini kita juga akan mengunjungi Itaewon Mosque bagi yang muslim atau bagi yang non Muslim dapat mengunjungi jalan terkenal di film Itaewon Class, yaitu Noksapyeong Street. Kemudian kita akan mengunjungi dan bermain di taman hiburan Lotte World Theme Park (Include One Day Pass) yang merupakan taman hiburan indoor terbesar di Korea. Check-in hotel Istirahat.\r\nBermalam di Golden City Dongdaemun Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:5:\"SEOUL\";s:9:\"deskripsi\";s:606:\"Setelah Santap pagi. Kita akan mengunjungi Health Care Shop (Red Pine Tree), Amethyst Show case. Hari ini kita akan mengunjungi HIKR Ground, disini kita akan berfoto bak artis K-Pop. Hari ini kita akan mengunjungi N-Seoul Tower, disini kita dapat meletakkan gembok cinta di Love & Lock. Kemunian menuju Gangnam COEX Mall, disini kita dapat mengunjungi Starfield Library yang merupakan perpustakaan terbesar dan popular yang berada di tengah pusat perbelanjaan. Dilanjutkan berbelanja di Duty Free Shop dan Myeongdong Street. Check-in Hotel istirahat.\r\nBermalam di Golden City Dongdaemun Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:34:\"SEOUL -  SINGAPORE(Meals on Board)\";s:9:\"deskripsi\";s:267:\"Sarapan pagi, Pagi ini kita akan mengunjungi Songdo Central Park, pusat perkotaan baru di Korea Selatan, setelah itu kita akan mengunjungi Local Supermarket untuk berbelanja oleh-oleh sebelum ke Incheon Airport. Tiba waktunya  diantar ke Airport untuk kembali pulang.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:37:\"ICN (16.35) – KUL (22.20)  by SQ601\";}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:35:\"SINGAPORE - JAKARTA(Meals on Board)\";s:9:\"deskripsi\";s:103:\"Kita akan melanjutkan kembali perjalanan ke Jakarta, dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:37:\"SIN (06.50) – CGK (07.35)  by SQ950\";}}', 'Tiket International Jakarta-Incheon by Singapore Airlines (Premium Airlines), Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\n✔	Bagasi sesuai dengan ketentuan Airlines (SQ Group 25kg) \r\n✔	Akomodasi hotel *3 setaraf (Twin / Triple)\r\n✔	Transportasi bus Pariwisata & tiket masuk objek wisata\r\n✔	Acara Tour & makan sesuai program paket tour diatas\r\n✔	Mineral Water 1 Botol Perhari\r\n✔	Tour Leader \r\n✔	Travel Kits (Luggage Tag)\r\n✔	Travel Insurance', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:16:\"VISA GROUP KOREA\";s:14:\"exclusion_rate\";s:6:\"625000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:2;a:3:{s:9:\"exclusion\";s:20:\"RENTAL WIFI PORTABLE\";s:14:\"exclusion_rate\";s:6:\"490000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:3;a:3:{s:9:\"exclusion\";s:17:\"VISA SINGLE KOREA\";s:14:\"exclusion_rate\";s:6:\"980000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, 'MEMORABLE CHRISTMAS HOLIDAY KOREA+EVERLAND 6D BY SQ (1).docx', 'KOREA'),
