(23, '2023-09-02 10:58:14', '2023-09-02 10:58:14', 'PREMIUM YEAR END HOLIDAY KOREA BUSAN 8D (YATCH EXPERIENCE+ LOTTE THEMEPARK)', 'PYHKORBUS8D', 'a:8:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:36:\"JAKARTA – INCHEON (Meals on Board)\";s:9:\"deskripsi\";s:159:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Incheon Maskapai bintang 5 versi Skytrax.\r\nBermalam di PESAWAT\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:39:\"CGK (23.15) – ICN (08.30)+1 by GA 878\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:16:\"INCHEON  - BUSAN\";s:9:\"deskripsi\";s:506:\"Setiba di Incheon disambut Guide berbahasa Indonesia yang ramah kemudian kita akan langsung  menuju Busan dengan menggunakan bus untuk mengunjungi Haedong Yonggungsa Temple dimana kuil ini terletak di pinggir pantai, kemudian kita akan menikmati sunset di pantai Haeundae dan mengunjungi Haeundae Beach Train selanjutnya kita akan melewati jembatan Gwangan untuk menikmati pemandangan malam di Busan. Check-in Hotel.  \r\nBermalam di Arban Hotel Busan ***/similar ATAU Crown Harbour Hotel Busan ****/ similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:5:\"BUSAN\";s:9:\"deskripsi\";s:719:\"Sarapan pagi di hotel. Lalu kita akan berkeliling menaiki Yatch di Busan sebelum kita mengunjungi Oryukdo Skywalk, jembatan kaca yang menjorok ke arah laut membentuk huruf U, dilanjutkan menuju Desa Budaya Gamcheon atau dikenal dengan sebutan Machu Picchu Korea dikarenakan bangunan di desa ini penuh dengan warna warni dan artistic yang dapat memanjakan mata yang melihatnya, kemudian kita akan mengunjungi Yongdusan Park disini kita dapat melihat Busan Tower, dilanjutkan berbelanja dan menikmati streetfood di Biff Busan, tidak hanya itu kita juga akan menikmati jajanan makanan seafood di Jagalchi Market. Check-in Hotel     \r\nBermalam di Arban Hotel Busan *** /