il berkeliling. Dilanjutkan menuju Bukchon Hanok Village disana kita dapat melihat rumah tradisional Korea Selatan yaitu Hanok, Dilanjutkan berbelanja di Hongdae Youth Avenue\r\n,Bermalam di Denim Hotel Gangnam*** / similar ATAU Standford Hotel ****/ Similiar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:5:\"SEOUL\";s:9:\"deskripsi\";s:691:\"Sarapan pagi di hotel Kita akan mengunjungi Health Care Shop (Red Pine Tree) dan Amethyst Show case. Hari ini kita akan mengunjungi N-Seoul Tower, disini kita dapat meletakkan gembok cinta di Love & Lock. Kemunian menuju Namsangol Hanok Village, disini kita dapat melihat rumah dan isi dari rumah tersebut yaitu Hanok . Selanjutnya kita mengunjungi Itaewon Mosque dan dapat shalat sejenak di masjid terkenal di Korea, bagi yang non muslim dapat mengunjungi Noksapyeong Street, jalanan Itaewon yang sangat terkenal pada drama “Itaewon Class”. Dilanjutkan berbelanja di Duty Free Shop dan Myeongdong Street.\r\nBermalam di Denim Hotel Gangnam*** / similar ATAU Standford Hotel ****/ Similiar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:7;a:7:{s:4:\"hari\";s:1:\"8\";s:6:\"lokasi\";s:32:\"SEOUL -  JAKARTA(Meals on board)\";s:9:\"deskripsi\";s:214:\"Sarapan pagi, lalu mengunjungi Local Supermarket untuk berbelanja oleh-oleh sebelum ke Incheon Airport. Tiba waktunya  diantar ke Airport untuk kembali ke Jakarta, dan sampai jumpa di tour selanjutnya Bersama kami.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:33:\"ICN (10.35) -CGK (15.35) by GA879\";}}', '✔	 Tiket International Jakarta-Incheon  Garuda Indonesia Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\n✔	Bagasi sesuai dengan ketentuan Airlines \r\n✔	Akomodasi hotel *3 setaraf (Twin / Triple)\r\n✔	Transportasi bus Pariwisata & tiket masuk ob