ngunjungi  Gangnam COEX Mall dimana kita dapat berbelanja oleh-oleh disana, disini terdapat Starfield Library. kemudian mengunjungi K-Star Road disini Anda dapat berfoto dengan beberapa ikon K-Pop.Dilanjutkan shopping di Sinsa Garosu-Gil. Setelah itu mengunjungi Seokchon Lake Park yang merupakan taman dan danau disana terdapat landmark terkenal yaitu Kuil Jogyesa, dilanjutkan photo stop di Lotte Tower.Check-in hotel istirahat\r\nBermalam di Golden City Hotel ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:5:\"SEOUL\";s:9:\"deskripsi\";s:575:\"Sarapan pagi di hotel,  kita akan mengunjungi K-cosmetic Shop pusat kosmetik terbaik dan nomor 1 di korea, kemudian kita dapat belajar membuat makanan khas dari korea yaitu Kimchi di Making Kimchi, kemudian kita akan mengunjungi Gyeongbokgung Palace, disini kita akan mengenakan hanbok sambil berkeliling,Selanjutnya kita akan melewati Blue House. Dilanjutkan menuju Bukchon Hanok Village disana kita dapat melihat rumah tradisional Korea Selatan yaitu Hanok, Dilanjutkan berbelanja di Hongdae Youth Avenue. Check-in hotel istirahat\r\nBermalam di Golden City Hotel ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:5:\"SEOUL\";s:9:\"deskripsi\";s:577:\"Sarapan pagi di hotel.Kita akan mengunjungi  National Gingseng Museum) dan Amethyst Show case. Dilanjutkan mengunjungi N-Seoul Tower, disini kita dapat meletakkan gembok cinta di Love & Lock. Kemunian menuju Namsangol Hanok Village, disini kita dapat melihat rumah dan isi dari rumah tersebut yaitu Hanok . Selanjutnya kita mengunjungi Itaewon Mosque dan dapat shalat sejenak di masjid terkenal di Korea, jalanan Itaewon yang sangat terkenal pada drama “Itaewon Class”. kemudian berbelanja di Duty Free Shop dan Myeongdong Street.\r\nBermalam di Golden City Hotel ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:33:\"SEOUL - JAKARTA  (Meals on Board)\";s:9:\"deskripsi\";s:214:\"Sarapan pagi, lalu mengunjungi Local Supermarket untuk berbelanja oleh-oleh sebelum ke Incheon Airport. Tiba waktunya  diantar ke Airport untuk kembali ke Jakarta, dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:77:\"ICN (09.00) – SIN (14.45) by SQ 607 & SIN (17.20) – CGK (18.05) by SQ 964\";}}', '✔	 Tiket International Jakarta-Incheon by Singapore Airlines Group, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend). (Singapore-Jakarta Keberangkatan 1 dan 2 January akan menggunakan Scoot with Meals and baggage)✔	  Bagasi sesuai dengan ketentuan Airlines✔	  Akomodasi hotel *3 setaraf (Twin / Triple)✔	  Transportasi bus Pariwisata & tiket masuk objek wisata✔	  Acara Tour & makan sesuai program paket tour diatas✔	  Mineral Water 01 Botol Perhari✔	  Tour Leader ✔	  Travel Kits (Luggage Tag)✔	  Travel Insurance', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:16:\"VISA GROUP KOREA\";s:14:\"exclusion_rate\";s:6:\"625000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:2;a:3:{s:9:\"exclusion\";s:20:\"RENTAL WIFI PORTABLE\";s:14:\"exclusion_rate\";s:6:\"490000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:3;a:3:{s:9:\"exclusion\";s:17:\"VISA SINGLE KOREA\";s:14:\"exclusion_rate\";s:6:\"980000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', 'WhatsApp Image 2023-12-15 at 10.12.19_b59db2a1.jpg', '7D AFTER NEW YEAR KOREA BY SQ GRP[1].docx', 'KOREA'),
(27, '2023-09-09 10:04:17', '2023-09-09 10:04:17', 'GOLDEN ROUTE PREMIUM JAPAN 7D TOKYO AND OSAKA+UNIVERSAL STUDIO DAN DISNEYLAND', 'GLDNPREMJPN7D', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:34:\"JAKARTA – OSAKA (Meals on board)\";s:9:\"deskripsi\";s:257:\"Malam ini kita berkumpul di bandara Seokarno-Hatta untuk berangkat menuju ke Osaka dengan Singapore Airlines *5 star versi skytrax*. Sesampainya di Singapore Airlines, kita dapat berkesempatan menikmati keindahan Jewel Changi Waterfall.\r\nBermalam di pesawat\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:101:\"CGK (14.10) – SIN (17.00) by SQ959 & SIN (01.25)+1 – KIX (08.50)+1 by SQ618 => Singapore Airlines\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:28:\"OSAKA-UNIVERSAL STUDIO JAPAN\";s:9:\"deskripsi\";s:748:\"Setelah sampai di Jepang, kita akan disambut guide yang ramah, setelah itu anda akan langsung diajak untuk mengunjungi tempat pembuatan film yang terbesar dan termegah dunia di Osaka yaitu Universal Studios Japan dengan shownya seperti Super Nintendo World, Despicable Me Minion Mayhem, The Wizarding World of Harry Potter, The Amazing Adventure Of Spider-Man: The Ride, Hollywood Dream: The Ride, Water World Show, The Terminator 2 (3D), Shrek’s (4D) Adventure/Sesame Street – Movie Magic, E.T Adventure, Snoopy’s Playland, Jurassic Park, dll. Setelah itu Anda berkesempatan untuk berbelanja di salah satu pusat perbelanjaan terkenal di kota Osaka yaitu Shinsaibashi. Check-in hotel istirahat.\r\nBermalam di Osaka Plaza Hotel ****  or similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:27:\"OSAKA – KYOTO - TOYOHASHI\";s:9:\"deskripsi\";s:469:\"Setelah santap pagi, kita akan menuju Kyoto untuk mengunjungi Kiyomizu Temple yang merupakan kuil Budha kuno yang dibangun sejak tahun 798 dan mengalami 10 kali kerusakan akibat perang dan bencana alam. Kemudian kita akan menuju Fushimi Inari Taisha yang merupakan kuil Shinto dan juga kuil pusat bagi sekitar 40.000 kuil Inari yang memuliakan Inari. Selanjutnya kita akan menuju Toyohashi. Check-in hotel istirahat.\r\nBermalam di Loisir Hotel Toyohashi ****  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:21:\"TOYOHASHI – MT.FUJI\";s:9:\"deskripsi\";s:464:\"Setelah santap pagi, kita akan mengunjungi Gunung Fuji yang merupakan gunung terindah dan tertinggi di Jepang, dengan menggunakan Bullet train dari Toyohasi Tohamamatsu (1 stop) sampai 5th Station (Jika cuaca mendukung). Di perjalanan kita juga akan berbelanja di premium outlet terbesar di Jepang, Gotemba Premium Outlet, disini anda dapat berbelanja berbagai macam brand ternama. Check-in hotel istirahat.\r\nBermalam di Jiragonno Fuji Yakata Hotel ***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:33:\"TOKYO DISNEYLAND/TOKYO DISNEY SEA\";s:9:\"deskripsi\";s:246:\"Setelah santap pagi, kita akan menuju Tokyo Disneyland/Tokyo Disney Sea yang merupakan taman hiburan Disney pertama yang dibangun di luar Amerika Serikat (Termasuk One Day Pass). Check in hotel istirahat.\r\nBermalam di T Mark Omori ***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:15:\"TOKYO CITY TOUR\";s:9:\"deskripsi\";s:619:\"Setelah santap pagi, kita akan mengunjungi Asakusa Kannon Temple atau yang dilebih dikenal dengan Sensoji merupakan salah satu kuil yang paling populer. dilanjutkan melewati Imperial Palace yang merupakan kompleks Istana tempat kediaman kaisar Jepang. Kemudian Anda juga akan diajak photostop dengan background Tokyo Tower (Foot Town) yang merupakan menara tertinggi kedua didunia(634m). kita juga akan mengunjungi Shibuya, distrik perbelanjaan terkemuka di Jepang disini terdapat ikon dengan monumen Hachiko yang sangat terkenal sebagai anjing yang setia. Setelah itu kita akan diantar menuju airport untuk kepulangan.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:37:\"HND (22.55)  – SIN (04.55) by SQ635\";}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:41:\"TOKYO(HANEDA) - JAKARTA  (Meals on Board)\";s:9:\"deskripsi\";s:125:\"Hari ini kita akan sampai di bandara Soekarno Hatta Jakarta.  Sampai jumpa di perjalanan menyenangkan bersama kami berikutnya\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:35:\"SIN (06.20) – CGK (07.55) bySQ950\";}}', '✔	Tiket International Jakarta-Osaka/ Haneda-Jakarta dengan Singapore Airlines, Economy termasuk seluruh taxes(Tiket Grup Fixed Date & No Extend) \r\n✔	 Bagasi 25 kg per orang atau sesuai dengan ketentuan Airlines\r\n✔	Akomodasi hotel *3/*4 setaraf (Twin / Triple)\r\n✔	Transportasi bus Pariwisata & tiket masuk objek wisata\r\n✔	Acara Tour &makan sesuai program paket tour diatas\r\n✔	Mineral Water 01 Botol Perhari\r\n✔	Tour Leader \r\n✔	Travel Insurance\r\n✔	Lugage Tag', 'a:5:{i:0;a:3:{s:9:\"exclusion\";s:17:\"VISA SINGLE JAPAN\";s:14:\"exclusion_rate\";s:6:\"800000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:2;a:3:{s:9:\"exclusion\";s:20:\"RENTAL WIFI PORTABLE\";s:14:\"exclusion_rate\";s:6:\"490000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:3;a:3:{s:9:\"exclusion\";s:17:\"VISA WAIVER JAPAN\";s:14:\"exclusion_rate\";s:6:\"275000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:4;a:3:{s:9:\"exclusion\";s:19:\"VISA MULTIPLE JAPAN\";s:14:\"exclusion_rate\";s:7:\"1300000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, 'GOLDEN ROUTE PREMIUM JAPAN 7D SQ MAY-NOV (2) (1).docx', 'JAPAN'),
(28, '2023-09-09 10:52:01', '2023-09-09 10:53:16', 'AMAZING TOKYO 6D+ONSEN EXPERIENCE', 'AMZTOKYO6D', 'a:6:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:35:\"JAKARTA – NARITA (Meals on board)\";s:9:\"deskripsi\";s:137:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta untuk berangkat menuju ke Tokyo dengan pesawat Malaysia Airlines.\r\nBermalam di PESAWAT\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:77:\"CGK (18.25)  – KUL (21.35) by MH 722 & KUL (23.35) – NRT (07.15) by MH088\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:13:\"NARITA -TOKYO\";s:9:\"deskripsi\";s:561:\"Setiba di Tokyo disambut Guide yang ramah, kemudian mengunjungi Gunung Fuji sampai 5th Station (Jika cuaca mendukung),  yang merupakan gunung terindah dan tertinggi di Jepang. Di perjalanan kita juga akan berbelanja di premium outlet terbesar di Jepang, Gotemba Premium Outlet, disini anda dapat berbelanja berbagai macam brand ternama. Setelah selesai kita akan Check-in hotel di Lake Kawaguchi, disini kita dapat menikmati onsen dan malan malam  dengan Yukata (Baju Tradisional Jepang) dihotel istirahat.\r\nBermalam di Kawaguchiko Jiragono Hotel***  or similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:24:\"LAKE KAWAGUCHI – TOKYO\";s:9:\"deskripsi\";s:683:\"Setelah sarapan pagi, kita akan melanjutkan tour hari ini diawali dengan menikmati keindahan alam danau Ashi dengan Lake Ashi Cruise. Dilanjutkan  menuju Hakone dimana kita dapat menikmati onsen alaminya disini. Tak hanya itu kita juga dapat menikmati keindahan alamnya. Setelah itu mengujungi Owakudahi Hell Valley, Merupakan tempat yang terkenal dari uap mendidih yang muncul dari gunung dan juga memiliki pemandangan indah dan Telur Hitam yang disebut Kurotamago. Dilanjutkan menuju Oshino Hakkai Village Setelah selesai Kembali ke Tokyo dan berbelanja di Shinjuku sebelum  makan malam dan kembali ke hotel untuk istirahat.\r\nBermalam di Tmark City Hotel Tokyo Omori***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:16:\"TOKYO (FREE DAY)\";s:9:\"deskripsi\";s:236:\"Sarapan pagi di hotel, Setelah ini kita bebas kemanapun. Hari ini kita dapat mengunjungi Tokyo Disney Land/ Tokyo Disney Sea dengan biaya sendiri. (Tanpa Private bus, Tanpa guide)\r\nBermalam di Tmark City Hotel Tokyo Omori***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:15:\"TOKYO CITY TOUR\";s:9:\"deskripsi\";s:574:\"Setelah santap pagi, kita akan mengunjungi Asakusa Kannon Temple atau yang dilebih dikenal dengan Sensoji merupakan salah satu kuil yang paling populer. dilanjutkan melewati Imperial Palace yang merupakan kompleks Istana tempat kediaman kaisar Jepang. Kemudian Anda juga akan diajak photostop dengan background Tokyo Sky tree (PhotoStop). Kita juga akan diajak melihat kita juga akan mengunjungi Odaiba, distrik perbelanjaan yang terdapat venue foto unik yaitu patung liberty dan robot gundam raksasa. Kemudian kita akan berbelanja di Shibuya sebelum di antar menuju airport\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:33:\"HND (00.30) – KUL (07.10) MH089\";}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:31:\"HANEDA - KUALA LUMPUR - JAKARTA\";s:9:\"deskripsi\";s:124:\"Hari ini kita akan melanjutkan perjalanan pulang ke tanah air. Sampai jumpa di perjalanan menyenang bersama kami berikutnya.\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:33:\"KUL (09.00) – CGK (10.10) MH711\";}}', '✔	Tiket International Jakarta-Tokyo PP dengan Malaysia Airlines, Economy termasuk seluruh taxes(Tiket Grup Fixed Date & No Extend) ✔	 Bagasi sesuai dengan ketentuan Airlines✔	Akomodasi hotel *3 atau *4 setaraf (Twin / Triple)✔	Transportasi bus Pari