(37, '2023-09-16 12:00:50', '2023-11-09 10:26:49', '7D GOLDEN ROUTE JAPAN + SHIRAKAWAGO', '7DGRJ-S24', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:15:\"Jakarta - Osaka\";s:9:\"deskripsi\";s:128:\"Malam ini kita berkumpul di bandara Seokarno-Hatta untuk berangkat menuju ke Osaka dengan Premium Airlines.\r\nBermalam di pesawat\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:77:\"CGK (15.45) – KUL (18.55) by MH720 & KUL (22.40) – KIX (05.40)+1 by MH052\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:12:\"Osaka - Nara\";s:9:\"deskripsi\";s:531:\"Setelah sampai di Jepang, kita akan disambut guide yang ramah, setelah itu anda akan langsung diajak untuk mengunjungi Todaji Temple yang ada di Kota Nara, kemudian kita akan menuju Osaka untuk berfoto di Osaka Castle (Photostop) dan juga Umeda Sky Building (Photostop) yang merupakan dua bangunan dengan memiliki 40 lantai yang terhubung dengan jembatan dan escalator melintasi ruang luas seperti atrium di tengahnya. Dilanjutkan berbelanja di Shinsaibashi. Check-in hotel istirahat.\r\nBermalam di Osaka Plaza Hotel ***  or similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:20:\"Osaka - Kyoto - Gifu\";s:9:\"deskripsi\";s:462:\"Setelah santap pagi, kita akan menuju Kyoto untuk mengunjungi Kiyomizu Temple yang merupakan kuil Budha kuno yang dibangun sejak tahun 798 dan mengalami 10 kali kerusakan akibat perang dan bencana alam. Kemudian kita akan menuju Fushimi Inari Taisha yang merupakan kuil Shinto dan juga kuil pusat bagi sekitar 40.000 kuil Inari yang memuliakan Inari. Selanjutnya kita akan menuju Kota Gifu. Check-in hotel istirahat.\r\nBermalam di Gifu Resort Hotel *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:45:\"Gifu – Shirakawago – Takayama - Matsumoto\";s:9:\"deskripsi\";s:521:\"Setelah santap pagi, kita akan mengunjungi Shirakawago Village yang berada di Kota Gifu, disini kita dapat melihat rumah traditional Jepang yaitu gassho-zukuri dilanjutkan menuju Takayama old town atau yang disebut dengan The Sannomachi, yang merupakan kawasan pedesaan dengan bangunan tradisional Jepang yang masih dipelihara dan berfungsi sampai hari ini, disini kita dapat berbelanja souvenir khas Jepang. Dilanjutkan menuju Matsumoto. Check-in Hotel istirahat\r\nBermalam di Premier Cabin Hotel Matsumoto *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:20:\"Matsumoto - Mt. Fuji\";s:9:\"deskripsi\";s:445:\"Setelah santap pagi. Kita akan mengunjungi Gunung Fuji yang merupakan gunung terindah dan tertinggi di Jepang, (1 stop) sampai 5th Station (Jika cuaca mendukung).  Dilanjutkan menuju Oshino Hakkai Village. Kemudian kita juga akan berbelanja di premium outlet terbesar di Jepang, Gotemba Premium Outlet, disini anda dapat berbelanja berbagai macam brand ternama. Check-in hotel istirahat.\r\nBermalam di Premier Cabin Hotel Matsumoto *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:22:\"Lake Kawaguchi - Tokyo\";s:9:\"deskripsi\";s:666:\"Setelah santap pagi,  kita akan melanjutkan tour hari ini diawali dengan menikmati keindahan alam danau Ashi dengan Lake Ashi Cruise. Dilanjutkan mengunjungi Asakusa Kannon Temple atau yang dilebih dikenal dengan Sensoji merupakan salah satu kuil yang paling populer.kita juga dapat berbelanja di Nakamise Street, dilanjutkan melewati Imperial Palace yang merupakan kompleks Istana tempat kediaman kaisar Jepang. Kemudian Anda juga akan diajak photoshop dengan background Tokyo Sky Tree. Kita juga akan mengunjungi Ginza, Dilanjutkan menuju Shinjuku yang meripakan pusat perbelanjaan di Tokyo.  Check-in Hotel Istirahat\r\nBermalam di T mark Omori Hotel *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:15:\"Tokyo - Jakarta\";s:9:\"deskripsi\";s:145:\"Setelah santap pagi kita akan diantarkan ke airport untuk Kembali ke tanah air.  Sampai jumpa di perjalanan menyenangkan bersama kami berikutnya.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:81:\"NRT (10.05) – KUL (17.05)+1D by MH037 &  KUL (22.20) – CGK (23.30) byMH727\";}}', 'Tiket International Jakarta-Osaka/ Narita-Jakarta dengan Malaysia Airlines, Economy termasuk seluruh taxes (Tiket Grup Fixed Date & No Extend)  Bagasi 30 kg per orang atau sesuai dengan ketentuan AirlinesAkomodasi hotel *3/*4 setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour &makan sesuai program paket tour diatasMineral Water 01 Botol PerhariTour Leader Travel Insurance sampai usia 69 tahunLuggage Tag', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:20:\"Visa Jepang (Single)\";s:14:\"exclusion_rate\";s:6:\"800000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:11:\"Visa Waiver\";s:14:\"exclusion_rate\";s:6:\"275000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:34:\"Tipping Guide, Driver, Tour Leader\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:3;a:3:{s:9:\"exclusion\";s:20:\"RENTAL WIFI PORTABLE\";s:14:\"exclusion_rate\";s:6:\"490000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '7D GOLDEN ROUTE JAPAN + SHIRAKAWAGO 2024.docx', 'Japan'),
(38, '2023-09-18 11:12:58', '2023-11-06 10:43:09', '8D CHINA POPULAR SHANGHAI - BEIJING', '8DCP-SB', 'a:8:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:18:\"Jakarta - Shanghai\";s:9:\"deskripsi\";s:394:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Shanghai dengan Singapore Airlines (Maskapai bintang 5 versi Skytrax) setelah sampai di Shanghai, kita akan disambut oleh Guide dan langsung menuju The Bund yang merupakan simbol dari kota Shanghai, sebelum ke hotel untuk beristirahat.\r\nBermalam di Holiday Inn Baoshan Baoyang Hotel **** / similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:78:\"CGK (05.25) – SIN (08.10) by SQ951 & SIN (09.30) – PVK (15.05) by SQ830\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:8:\"Shanghai\";s:9:\"deskripsi\";s:493:\"Sarapan pagi di hotel. Kita akan menuju XinTianDi yang merupakan salah satu lokasi hiburan penting di China. Dilanjutkan menuju TianZiFang dimana tempat ini memiliki bangunan berarsitektur tradisional khas China dengan bar, kafe, toko, galeri dan butik yang memiliki desain menawan, kemudian kita juga akan berfoto di TV Tower (PhotoStop) Selanjutnya kita akan mengunjungi Zhang Yuan dan berbelanja di Nanjing Road. Check-in Hotel.\r\nBermalam di Holiday Inn Baoshan Baoyang Hotel **** / similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:28:\"Shanghai - Wuzhen - Hangzhou\";s:9:\"deskripsi\";s:390:\"Sarapan pagi di hotel. Lalu kita akan langsung menuju Wuzhen (termasuk Kapal) yang merupakan sebuah kota di tengah air. Kemudian kita akan menuju Hangzhou untuk mengunjungi West Lake menggunakan Kapal dilanjutkan mengunjungi  Yuefei Temple dimana kuil ini dibangun untuk menghormati Yue Fei, salah satu pahlawan dinasti China. Check-in Hotel\r\nBermalam di Baosheng Daegu Hotel **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:17:\"Hangzhou - Suzhou\";s:9:\"deskripsi\";s:389:\"Sarapan pagi di hotel, Kita akan mengunjungi Tea Garden, kemudian menuju Suzhou untuk mengunjungi Couples Retreat Garden atau yang disebut dengan Ou Yuan Garden terkenal dengan Taman yang bertemakan khas China zaman dulu, dilanjutkan menuju Jinji Lake, danau terbesar di kota China kemudian kita akan berbelanja di Guanqian Street. Check-in Hotel. \r\nBermalam di Suyuan Hotel **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:16:\"Suzhou - Beijing\";s:9:\"deskripsi\";s:169:\"Sarapan pagi di hotel, Kita akan mengunjungi Silk Factory kemudian menuju Kota Beijing menggunakan Bullet Train. Check-in Hotel.\r\nBermalam di Palace Hotel **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:7:\"Beijing\";s:9:\"deskripsi\";s:345:\"Sarapan pagi di hotel, Kita akan mengunjungi Temple of Heaven merupakan kuil dengan gaya arsitektur yang khas dan megah. Kemudian dilanjutkan menuju Tian An Men Square yang merupakan lapangan terluas di dunia, selanjutnya kita akan menuju Wangfujing disini kita dapat berbelanja oleh-oleh. Check-in Hotel\r\nBermalam di Palace Hotel **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:19:\"Beijing - Singapore\";s:9:\"deskripsi\";s:492:\"Sarapan pagi di hotel. Kita kan mengunjungi Juyongguan Great Wall, tembok terpanjang didunia dan termasuk salah satu keajaiban dunia. Dilanjutkan menuju Beijing Stadium Nasional atau yang dikenal dengan Bird’s Nest (PhotoStop) & Water Cube National Aquatics Center (PhotoStop) kemudian kita akan berbelanja di Silk Market dan kita akan mencoba makanan Khas dari negara China yaitu bebek Peking. Dilanjutkan perjalanan ke menuju airport dengan transit di Singapore sebelum kembali ke Jakarta\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:37:\"PEK (00:05) – SIN (06:00)  by SQ801\";}i:7;a:7:{s:4:\"hari\";s:1:\"8\";s:6:\"lokasi\";s:19:\"Singapore - Jakarta\";s:9:\"deskripsi\";s:67:\"Tiba ditanah air dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:36:\"SIN (09:15) – CGK (10:10) by SQ956\";}}', 'Tiket International by Singapore Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) Bagasi 25 kg sesuai dengan ketentuan Airlines Akomodasi hotel *4 lokal atau setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour & makan sesuai program paket tour diatasMineral Water 01 Botol PerhariTour Leader Travel Kits (Luggage Tag) Travel Insurance  sampai usia 84 tahun', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:16:\"Visa Group China\";s:14:\"exclusion_rate\";s:7:\"1000000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:17:\"Visa Single China\";s:14:\"exclusion_rate\";s:7:\"1100000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:42:\"Tipping (Local Guide, Driver, Tour Leader)\";s:14:\"exclusion_rate\";s:6:\"800000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:3;a:3:{s:9:\"exclusion\";s:19:\"Modem Wifi Portable\";s:14:\"exclusion_rate\";s:6:\"560000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '8D6N CHINA POPULAR BEIJING+SHANGHAI BY SQ.docx', 'China');
