(39, '2023-09-18 11:35:32', '2023-09-20 14:12:06', '8D JIUZHAIGOU + LESHAN EMEISHAN', '8DCJ-LE', 'a:8:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:17:\"Jakarta - Chengdu\";s:9:\"deskripsi\";s:386:\"Hari ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Chengdu dengan Transit di Kuala Lumpur. Setiba di Bandar Udara Chengdu Tianfu, Chengdu Province, disambut Guide yang ramah kemudian kita akan langsung menuju hotel, check-in dan beristirahat\r\nBermalam di Holiday Inn Express ****/Similar **HOTEL SUDAH TERMASUK UNTUK ISTIRAHAT SAAT ARRIVAL**\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:79:\"CGK (16.10) – KUL (19.15) by OD-349 & KUL (21.35) – TFU (02.20)+1 by OD-672\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:27:\"Chengdu - Leshan - Emeishan\";s:9:\"deskripsi\";s:460:\"Pagi hari, peserta sarapan di Hotel, kemudian melanjutkan perjalanan ke daerah Leshan untuk mengunjungi Leshan Buddha Statue, sebuah patung buddha yang dibuat dari pahatan batu pasir merah dan dibangun pada masa Dinasti Tang dengan adanya pecahan dari 3 sungai di bawah kakinya (Sungai Minjiang, Sungai Qingyi, dan Sungai Dadu). Kemudian peserta akan pergi menuju kota Emeishan untuk Check-in Hotel dan beristirahat. \r\nBermalam di Century Sunshine ****/similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:21:\"Emeishan - Dujiangyan\";s:9:\"deskripsi\";s:506:\"Sarapan pagi di hotel, peserta akan mengunjungi Emeishan Culture Museum, lalu peserta menuju Baoguo Temple, sebuah kuil yang terletak di Gunung Emei, dimana terdapat 3 ajaran kepercayaan yang ada di dalamnya, seperti Buddha, Tao, dan juga Konfusianisme. Setelah itu, peserta juga akan mengunjungi Kuil Fuhu Emeishan, yang juga berdekatan lokasinya dengan Kuil Baoguo. Peserta akan melanjutkan perjalanan menuju Kota Dujiangyan. Check in hotel dan beristirahat. \r\nBermalam di Liwan Holiday Hotel ****/simila\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:23:\"Dujiangyan - Jiuzhaigou\";s:9:\"deskripsi\";s:691:\"Sarapan pagi di hotel, Peserta mengunjungi Songpan City Wall, sebuah tembok yang mengelilingi kota Songpan, dengan 7 pintu gerbang dan dibangun pada masa Raja pertama dinasi ming, Raja Zhu Yuanzhang berkuasa (1379 M). Tembok ini sangatlah kokoh yang dimana erosi dari angin dan air belum mampu merusak tembok ini sampai sekarang. Setelah itu, peserta pergi menuju Danau Diexi, sebuah danau yang terbentuk akibat Longsoran tanah akibat gempa pada tahun 1933 dan menenggelamkan kota tua Diexi sehingga kita masih dapat melihat beberapa spot seperti Menara pengawas, kuil, dan yang lainnya di tempat ini. Peserta akan Check in hotel dan beristirahat.\r\nBermalam di New Jiuzhai Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:10:\"Jiuzhaigou\";s:9:\"deskripsi\";s:601:\"Sarapan pagi di hotel, peserta akan mengunjungi Jiuzhaigou National Park dengan Public Eco Bus. Taman Nasional seluas 720km2 yang mempunyai bentuk permukaan yang berbeda di wilayah Utara dengan permukaan dataran yang rendah (2000 MDPL) dan wilayah Selatannya yang punya permukaan dataran lebih tinggi (4500 MDPL). Taman nasional ini sudah diresmikan sebagai warisan alam dunia oleh UNESCO World Heritage, dan juga sebagai habitat popular untuk Giant Panda dan dengan keberagaman ekosistem di dalamnya. Setelah itu, peserta Kembali ke hotel dan beristirahat \r\nBermalam di New Jiuzhai Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:32:\"Jiuzhaigou - Huanglong - Maoxian\";s:9:\"deskripsi\";s:426:\"Sarapan pagi di hotel, peserta akan mengunjungi HUANGLONG, Tempat situs warisan dunia dengan banyak pemandangan dan tempat wisata alam didalamnya. Tempat dengan area seluas 700km2 ini menjadi salah satu rumah untuk banyak hewan yang terancam punah seperti panda dan kera emas. Setelah itu, peserta akan melanjutkan perjalanan ke kota Maoxian, check in hotel dan beristirahat.\r\nBermalam di Westqiang Homeland Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:17:\"Maoxian - Chengdu\";s:9:\"deskripsi\";s:342:\"Sarapan pagi di hotel, peserta akan memulai perjalanan menuju kota Chengdu, mengunjungi Panda Base dengan Buggy Car. Dilanjutkan dengan mengunjungi Chunxi Road dan Taikooli, area yang terkenal dengan tempat untuk Shopping di wilayah kota Chengdu. Setelah makan malam. Peserta akan diantar menuju bandara untuk penerbangan menuju Kuala Lumpur.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:7;a:7:{s:4:\"hari\";s:1:\"8\";s:6:\"lokasi\";s:17:\"Chengdu - Jakarta\";s:9:\"deskripsi\";s:259:\"Dari Bandara International Chengdu Tianfu, China, peserta akan terbang dan transit di Kuala Lumpur International Airport. Dilanjutkan dengan penerbangan menuju Bandara International Soekarno Hatta, tour selesai dan sampai berjumpa di program tour selanjutnya.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:77:\"TFU (03.25) – KUL (07.55) By OD-673 & KUL (10.25) – CGK (11.30) By OD-316\";}}', 'Tiket International Jakarta-Chengdu Batik Air Malaysia Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) Bagasi sesuai dengan ketentuan Airlines (20Kg)Akomodasi hotel *4 Local setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour & makan sesuai program paket tour diatasMineral Water 1 Botol PerhariTour Leader Travel Kits (Luggage Tag)Travel Insurance (sampai usia 84 Tahun)', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:16:\"Visa Group China\";s:14:\"exclusion_rate\";s:7:\"1000000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:19:\"Modem Wifi Portable\";s:14:\"exclusion_rate\";s:6:\"560000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:34:\"Tipping Guide, Driver, Tour Leader\";s:14:\"exclusion_rate\";s:6:\"800000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:3;a:3:{s:9:\"exclusion\";s:17:\"Visa Single China\";s:14:\"exclusion_rate\";s:7:\"1100000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '8D JIUZHAIGOU+ LESHAN &EMEISHAN BY OD NOV-DEC.docx', 'China'),
(40, '2023-09-18 11:56:58', '2023-09-20 14:14:09', '10D CHINA NEW YEAR SHANGHAI', '10DCNYS', 'a:10:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:19:\"Jakarta - Singapore\";s:9:\"deskripsi\";s:142:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Shanghai dengan Scoot dan Singapore Airlines.\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:36:\"CGK (20.00) – SIN (23.00) by TR279\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:31:\"Singapore - Shanghai - Hangzhou\";s:9:\"deskripsi\";s:683:\"Hari ini kita telah sampai di Shanghai, dan kita akan disambut oleh Guide dan langsung menuju West Lake (termasuk kapal) yang merupakan destinasi wisata yang telah diakui oleh UNESCO akan keindahan alam dan kekayaan budayanya di sini kita akan diajak mengelilingi danau menggunakan boat. Setelah puas mengunjungi West Lake, kita akan mengunjungi Yu Fei Temple yaitu kuil yang didedikasikan untuk menghormati dan mengenang Jenderal Yu Fei. Selesai dari Yu Fei Temple, kita akan menuju Sudi yaitu jalanan yang menghubungkan bagian selatan dan utara West Lake. Kita dapat berjalan santai dan menikmati pemandangan. Check-in Hotel.\r\nBermalam di Liangan International Hotel **** / similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:36:\"SIN (01.15) – PVG (06.30) by SQ826\";}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:15:\"Hangzhou - Wuxi\";s:9:\"deskripsi\";s:462:\"Sarapan pagi di hotel. Kita akan mengunjungi Longjing Tea. Setelah itu kita akan menuju Nanxun Ancient Water Town (termasuk Kapal), di sana kita akan mengelilingin kota air tua Nanxung menggunakan boat. Selesai mengelilingin Nanxun, kita akan mengunjungin Nanchang Street yang merupakan destinasi hiburan dan terletak di kota Wuxi denga berbagai macam toko yang ada. Selesai dari Nanchang Street kita akan Check-in Hotel.\r\nBermalam di Mingdu Hotel **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:4:\"Wuxi\";s:9:\"deskripsi\";s:347:\"Sarapan pagi di hotel. Kita akan mengunjungi Teapot. Lalu kita akan menuju Three Kingdoms City (termasuk buggy) yang terletak di kota Wuxi dan akan mengelilingi destinasi tersebut menggunakan buggy. Selesai dari Three Kingdoms City, kita akan menikmati Night View of Suffrage Bay. Kemudian, Check-in Hotel.\r\nBermalam di Mingdu Hotel **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:12:\"Wuxi -Suzhou\";s:9:\"deskripsi\";s:379:\"Sarapan pagi di hotel. Kita akan berbelanja di Pearl Shop Wuxi, kemudian menuju Suzhou untuk mengunjungi Couples Retreat Garden (termasuk boat) atau yang disebut dengan Ou Yuan Garden terkenal dengan Taman yang bertemakan khas China zaman dulu, dilanjutkan menuju Jinji Lake, dan menikmati pemandangan malam hari di sana. Check-in Hotel. \r\nBermalam di Suyuan Hotel **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:17:\"Suzhou - Shanghai\";s:9:\"deskripsi\";s:422:\"Sarapan pagi di hotel. Kita akan berbelanja di Silk Market. Kemudian menuju Jade Buddha Temple yaitu kuil yang terkenal akan dua buah patung Buddha yang terbuat dari batu giok putih. Setelah dari Jade Buddha Temple, kita akan menuju Starbucks Roastery Shanghai yang merupakan salah satu starbucks terbesar di dunia. Kemudian kita akan Check-in Hotel.\r\nBermalam di Metropolo Jinjiang Hotel (Shanghai Minhang) **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:8:\"Shanghai\";s:9:\"deskripsi\";s:402:\"Sarapan pagi di hotel. Kita akan mengunjungi dan berbelanja Medicine Store. Setelah dari Medicine Store, kita akan mengunjungi Shanghai International Finance Centre. Selesai dari Shanghai International Finance Centre, kita akan menuju ke The Oriental Pearl Tower 2 Ball. Selesai mengunjungi Pearl Tower kita akan kembali ke Hotel.\r\nBermalam di Metropolo Jinjiang Hotel (Shanghai Minhang) **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:7;a:7:{s:4:\"hari\";s:1:\"8\";s:6:\"lokasi\";s:8:\"Shanghai\";s:9:\"deskripsi\";s:536:\"Sarapan pagi di hotel. Kita kan mengunjungi Zhujiajiao (termasuk boat) yang merupakan salah satu kota air tua dengan arsitektur mencerminkan budaya Tiongkok Selatan dengan bangunan yang indah. Selesai menjelajah Zhujiajiao, kita akan menuju Xintiandi yang merupakan sebuah distrik perbelanjaan dengan arsitektur yang unik. Kemudian kita akan menuju Shikumen yaitu bangunan unik dengan gaya pergabungan Tiongkok dengan Barat. Setelah itu kita akan kembali ke Hotel.\r\nBermalam di Metropolo Jinjiang Hotel (Shanghai Minhang) **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:8;a:7:{s:4:\"hari\";s:1:\"9\";s:6:\"lokasi\";s:17:\"Suzhou - Shanghai\";s:9:\"deskripsi\";s:235:\"Sarapan pagi di hotel. Kita akan berbelanja di Jewellery Shop, kemudian kita akan menuju ke pusat perbelanjaan Florentia Village Shanghai. Dilanjutkan perjalanan ke menuju airport dengan transit di Singapore sebelum kembali ke Jakarta.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:9;a:7:{s:4:\"hari\";s:2:\"10\";s:6:\"lokasi\";s:18:\"Shanghai - Jakarta\";s:9:\"deskripsi\";s:67:\"Tiba ditanah air dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:83:\"PVG (00:10) – SIN (06:00)  by SQ825 & ✈︎ SIN (09:50) – CGK (10:35) by TR276\";}}', 'Tiket International by Scoot Airlines and Singapore Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) Bagasi 25 kg sesuai dengan ketentuan Airlines Akomodasi hotel *4 lokal atau setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour & makan sesuai program paket tour diatasMineral Water 01 Botol PerhariTour LeaderTravel Kits (Luggage Tag)Travel Insurance sampai usia 84 tahun', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:17:\"Visa Single China\";s:14:\"exclusion_rate\";s:7:\"1100000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:19:\"Modem Wifi Portable\";s:14:\"exclusion_rate\";s:6:\"700000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:34:\"Tipping Guide, Driver, Tour Leader\";s:14:\"exclusion_rate\";s:7:\"1000000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:3;a:3:{s:9:\"exclusion\";s:16:\"Visa Group China\";s:14:\"exclusion_rate\";s:7:\"1000000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '10D8N CHINA NEW YEAR SHANGHAI by SQ dan TR.docx', 'China'),
(41, '2023-09-18 13:43:13', '2023-11-07 13:41:55', '7D6N DELIGHTFUL NEW YEAR HONGKONG', '7D2NYH', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:18:\"Jakarta - Hongkong\";s:9:\"deskripsi\";s:591:\"Pagi ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Hongkong dengan Garuda Indonesia (Maskapai bintang 5 versi Skytrax). Setelah sampai di Hongkong,  Dilanjutkan menuju Shenzhen. Setibanya di Shenzhen, kita akan mengunjungi Lotus Hill Park, sebuah bukit dan taman kota di Shenzhen. Selanjutnya kita akan mengunjungi Shenzhen Oh Bay (Tidak termasuk  Bay Glory). Kita juga dapat menikmati waktu bebas di Dongmeng Street, salah satu tempat berbelanja di kota Shenzhen. Check in hotel untuk beristirahat.\r\nBermalam di Century plaza hotel ****/ similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:39:\"CGK (07.25) – HKG (13.15) by GA870\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:18:\"SHENZHEN CITY TOUR\";s:9:\"deskripsi\";s:438:\"Sarapa2n pagi di hotel. Kita akan mengunjungi Jade shop yaitu toko perhiasaan di Shenzhen. Dilanjutkan menuju Mineral Shop atau di kenal dengan museum mineral yaitu tempat menyimpan berbagai batu giok. Kemudian kita menuju Splendid of China yaitu tempat dimana kita dapat menikmati pemandangan indah, miniatur kehidupan traditional masyarakat china, serta menyaksikan atraksi. Check-in Hotel\r\nBermalam di Century plaza hotel ****/ similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:19:\"SHENZHEN – ZHUHAI\";s:9:\"deskripsi\";s:647:\"Sarapan pagi di hotel. Kita akan melanjutkan perjalanan menuju Zhuhai. Kita mengunjungi Fisher Girl Statue merupakan land mark kota Zhuhai. Dilanjutkan ke  Lover Road untuk menikmati indahnya pemandangan pantai. Kemudian kita menuju Yeli Island & The Zhuhai Opera house, dimana kita dapat menikmati pemandangan indah dan bangunan yang dirancang sedemikian indah oleh arsitek, ini merupakan land mark kota Zhuhai. Kita juga akan berkunjung ke Bamboo shop dan Latex shop. Kita juga bekesempatan menikmati pertunjukan di dalam The New Yuanming Garden yang merupakan kompleks bangunan kerajaan. Check-in Hotel.\r\nBermalam di HUAFENG HOTEL ****/ similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:14:\"ZHUHAI - MACAU\";s:9:\"deskripsi\";s:566:\"Sarapan pagi di hotel, kita menuju Pelabuhan untuk menuju kota Macau. Setibanya di Macau, kita langsung menuju Ruins of St Paul merupakan reruntuhan gereja landmark Macau. Dilanjutkan ke A-ma Temple yaitu kuil tertua di kota Macau.  Kemudian menuju Venetian Resort, merupakan tempat bernuansa romantis seperti di Venesia Eropa. Kita juga mengunjungi ke Kawasan hiburan di kota Macau yaitu Fisherman’s Wharf. Kita akan berbelanja di Souvenir shop. Kita juga akan berkunjung ke Macau Tower untuk Photostop. Check-in Hotel.\r\nBermalam di CASA REAL HOTEL **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:18:\"MACAU – HONGKONG\";s:9:\"deskripsi\";s:771:\"Sarapan pagi di hotel. Kita akan menuju Pelabuhan untuk berlabuh Kembali ke kota Hongkong. Setibanya di kota Hongkong, kita akan menikmati pemandangan kota Hongkong di Avenue of Star. Dilanjutkan ke Jewelry Workshop. Kita juga akan memiliki waktu berbelanja di 1881 Heritage dan berkunjung ke Clock Tower. Kemudian menuju West Kowloon Art Park merupakan tempat wisata yang dimana terdapat bangunan yang bernilai sejarah dan seperti berada di kehidupan masa lalu kehidupan masyarakat Hongkong. Kita juga akan mengunjungi The School of Yaumatei dan Tin Hau Temple. Kita berkesempatan menikmati pemandangan kota Hongkong dari Victoria Peak menggunakan kereta gantung, Kawasan tertinggi di kota Macau. Check in Hotel.\r\nBermalam di HARBOUR PLAZA 8 DEGREES HOTEL **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:17:\"HONGKONG FREE DAY\";s:9:\"deskripsi\";s:274:\"Sarapan pagi di hotel, Hari ini kita bebas kemanapun yang kita mau dengan sendiri, hari ini kita juga dapat mengunjungi Disneyland Hongkong atau Cable car di Ngongping360 (Free Time: NO Bus, No Guide, No Tour Leader)\r\nBermalam di HARBOUR PLAZA 8 DEGREES HOTEL **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:18:\"HONGKONG - JAKARTA\";s:9:\"deskripsi\";s:164:\"Pagi hari setelah makan pagi, kita akan segera diantarkan ke airport untuk Kembali ke tanah air. Tiba ditanah air dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:39:\"HKG (14.15) – CGK (18.05) by GA863\";}}', 'Tiket International by Garuda Indonesia, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) Bagasi sesuai dengan ketentuan Airlines Akomodasi hotel *4 lokal atau setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour & makan sesuai program paket tour diatasMineral Water 01 Botol PerhariTour Leader Travel Kits (Luggage Tag) Travel Insurance  sampai usia 69 tahunGroup Visa China', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:19:\"Modem Wifi Portable\";s:14:\"exclusion_rate\";s:6:\"560000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '7D6N DELIGHTFUL NEW YEAR HONGKONG BY GA 29DEC REVISED ITINERARY.docx', 'Hongkong'),
