el dan bermalam di Bangkok.\r\nMenginap di Thomson ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:7:\"Bangkok\";s:9:\"deskripsi\";s:287:\"Setelah sarapan pagi. kita akan berbelanja di Platinum Fashion Mall, Leather shop Bangkok dan MBK Shopping Center, kemudian dilanjutkan menuju Big C Supermarket, kita juga akan mengunjungi China Town Bangkok sebelum kembali ke Hotel. Bermalam di Bangkok.\r\nMenginap di Thomson ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:17:\"Bangkok - Jakarta\";s:9:\"deskripsi\";s:154:\"Setelah sarapan pagi, perjalanan menuju Bandar Udara Internasional Suvarnabhumi untuk kembali ke Jakarta dengan  . Sampai jumpa di perjalanan selanjutnya.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:55:\"MH785 BKK-KUL 11.05-14-15 – MH723 KUL-CGK 16.10-17.35\";}}', 'Tiket International Jakarta-Bangkok by Malaysia Airlines Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\nBagasi sesuai dengan ketentuan Airlines (30Kg)\r\nAkomodasi hotel *4 dan*3 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour & makan sesuai program paket tour diatas\r\nMineral Water 1 Botol Perhari\r\nTour Leader \r\nTravel Kits (Luggage Tag)\r\nTravel Insurance sampai usia 84 Tahun', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"500000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:22:\"SIM Card International\";s:14:\"exclusion_rate\";s:6:\"200000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', 'AMAZING BANGKOK PATTAYA 5D4N.jpg', '5D4N AMAZING BANGKOK PATTAYA  BY MH (NEW) (2).docx', 'Thailand'),
(43, '2023-09-18 15:48:33', '2023-11-09 10:28:43', '7D COMPLETE SCHOOL HOLIDAY BANGKOK PATTAYA', '7DCSH-BP', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:16:\"Jakarta - Phuket\";s:9:\"deskripsi\";s:497:\"Hari ini kita akan berkumpul di Bandara Internasional Soekarno Hatta (2,5 Jam sebelum keberangkatan), untuk memulai perjalanan kita ke Phuket. Setibanya di Phuket, proses imigrasi dan bagasi. Kita akan menuju Big Buddha, patung Buddha setinggi 45 meter dimana Anda dapat menikmati pemandangan pulau Phuket 360° dari atas. Dilanjutkan untuk menyaksikan sunset di Promphet Cape. makan malam di restoran lokal kemudian check-in hotel dan bermalam di Phuket.\r\nMenginap di The Tree by APKl ***/setaraf\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:67:\"MH-726 17DEC CGK-KUL 04.25-07.30 & MH-786 17DEC KUL-HKT 09.10 09.50\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:23:\"Phuket - Phi Phi Island\";s:9:\"deskripsi\";s:796:\"Setelah sarapan pagi. Kita akan menuju pelabuhan untuk menyebrang ke Phi-Phi Island menggunakan Speed Boat. Setibanya di Pileh Lagoon, anda dapat menikmati aktivitas  dari berenang, snorkeling, atau mengunjungi Viking Cave, yang merupakan tempat bersarang burung Wallett. Dilanjutkan dengan makan siang di Phi-Phi Don Island. Setelah itu Anda dapat menikmati waktu bebas untuk menikmati dan mengelilingi Tonsai Beach. Perjalanan dilanjutkan dengan transfer menuju Khai Nhai Island, Pulau yang wajib dikunjungi karena keindahan pemandangan bawah lautnya. Anda dapat melakukan aktivitas snorkeling sambil menikmati pemandangan bawah laut. Kemudian Anda akan menuju pelabuhan untuk kembali ke Phuket untuk makan malam dan kembali ke hotel untuk beristirahat.\r\nMenginap di The Tree by APK ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:16:\"Phuket - Bangkok\";s:9:\"deskripsi\";s:594:\"Perjalanan hari ini diawali dengan perjalanan menuju Kata Karon Beach untuk menikmati pemandangan. Selanjutnya, Anda akan diantar menuju Wat Chalong Temple yang merupakan salah satu Kuil tertua dan terbesar di Phuket. Kemudian, Anda akan diajak untuk makan siang di local restaurant. Setelah makan siang anda akan mengunjungi Sino Portuguese, Gems Gallery, dan Dried Food. Kemudian dilanjutkan dengan makan malam sebelum Anda diantar menuju bandara untuk menuju Bangkok. Setibanya di Bangkok, Anda akan diantar menuju hotel untuk check-in dan beristirahat\r\nMenginap di Madison Hotel ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:17:\"Bangkok - Pattaya\";s:9:\"deskripsi\";s:520:\"Selepas santap pagi, Anda akan diajak menuju Pattaya. Anda akan menuju Nong Nooch Village untuk menyaksikan pertunjukan oleh orang Lokal dan Elephant Show. Dilanjutkan dengan makan siang di Nong Nooch. Setelah makan siang, anda akan diajak menuju Laser Buddha Hill untuk melihat pahatan Buddha yang dipahat dengan Laser. Selanjutnya Anda akan diajak menuju Pattaya Beach, dilanjutkan dengan makan malam di local restaurant sebelum menuju hotel untuk check-in dan beristirahat. \r\nMenginap di Baron Beach Hotel ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:17:\"Pattaya - Bangkok\";s:9:\"deskripsi\";s:658:\"Hari ini Anda akan diajak menuju Erawadee Shop untuk berbelanja. Kemudian, Anda akan diantar menuju Pattaya Floating Market, pasar Tradisional yang menggunakan perahu apung tradisional sebagai tempat untuk berjualan. Kemudian dilanjutkan dengan makan siang di local restaurant sebelum Anda menuju Bangkok. Setibanya di Bangkok, Anda akan diantar menuju Icon Siam & Sook Siam Floating Market. Perjalanan dilanjutkan dengan makan malam di local restaurant. Setelah makan malam, Anda akan diajak menikmati night market di Asiatique Night Market. Setelah itu, Anda akan diantar menuju hotel untuk check-in dan beristirahat.\r\nMenginap di Madison Hotel ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:7:\"Bangkok\";s:9:\"deskripsi\";s:526:\"Pada hari ini Anda akan diajak untuk mengunjungi Wat Arun menggunakan perahu sambil menyusurii Chaopraya River. Setelah itu Anda akan diajak untuk photo stop di Grand Palace. Selanjutnya menuju Honey Bee dan dilanjutkan menuju local restaurant untuk makan siang. Setelah makan siang, Anda akan diantar menuju Platinum Fashion Mall & Pratunam Market. Menuju malam hari, Anda akan menuju Jodd Fairs Night Market. Makan malam di local restaurant sebelum kembali ke Hotel untuk beristirahat.\r\nMenginap di Madison Hotel ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:17:\"Bangkok - Jakarta\";s:9:\"deskripsi\";s:139:\"Setelah sarapan pagi, perjalanan menuju Bandar Udara Internasional Phuket untuk kembali ke Jakarta. Sampai jumpa di perjalanan selanjutnya.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:138:\"MH-783 23DEC BKK-KUL 17.05-20.25 + MH-727 23DEC KUL-CGK 22.20 23.30 // MH-785 25DEC BKK-KUL 11.05-14.25 - MH-723 25DEC KUL-CGK 16.25-17.30\";}}', 'Tiket International Jakarta-Bangkok by Malaysia Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) Bagasi sesuai dengan ketentuan Airlines (30Kg)Akomodasi *3 setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour & makan sesuai program paket tour diatasMineral Water 1 Botol PerhariTour Leader Travel Kits (Luggage Tag)Travel Insurance', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Gu