(48, '2023-09-19 10:18:51', '2023-09-20 14:20:50', '6D VIETNAM FAVORITE DANANG - HO CHI MINH', '6DVDH', 'a:6:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:16:\"Jakarta - Saigon\";s:9:\"deskripsi\";s:715:\"Hari ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Saigon, Vietnam dengan Transit di Kuala Lumpur, Malaysia. Setiba di Tan Son Nhat International Airport, peserta disambut Guide yang ramah kemudian kita akan langsung pergi menuju Old Post Office, salah satu tempat wisata yang ikonik di Kota Ho Chi Minh dengan model bangunan bergaya Perancis jaman dahulu. Lalu peserta akan mengunjungi Ho Chi Minh Square, tempat monument dari pemimpin pertama Vietnam yang juga dikenal sebagai pahlawan nasional Vietnam yang rendah hati, kemudian dilanjutkan dengan kunjungan ke French Opera House, pergi ke hotel, check-in dan beristirahat\r\nBermalam di Blue Diamond Luxury ***/Similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:77:\"CGK (09.45) – KUL (12.50) by OD-319 & KUL (14.20) – SGN (15.25) by OD-561\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:6:\"Saigon\";s:9:\"deskripsi\";s:598:\"Pagi hari, peserta sarapan di Hotel, kemudian menikmati perjalanan menuju Cu Chi Tunnel, sebuah terowongan besar bawah tanah, yang digunakan oleh pasukan Vietnam dalam perang saudara Vietnam tahun 1968. Disini peserta akan melihat bentuk-bentuk perangkap mematikan yang digunakan selama perang, ruangan masak bawah tanah, ruang pertemuan dan lain-lain. Setelah itu, peserta akan Kembali ke Kota Saigon dan langsung mengunjungi Buu Long Pagoda, sebuah kelenteng yang termasuk dalam 10 besar desain terbaik pagoda di dunia. Kembali ke hotel dan istirahat.\r\nBermalam di Blue Diamond Luxury ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:15:\"Saigon - Danang\";s:9:\"deskripsi\";s:766:\"Sarapan pagi di hotel, peserta akan menaiki kapal untuk menjelajahi Mekong Delta sambal melihat 4 pulau, Dragon, Unicorn, Turtle, Phoenix, dan juga melihat Jembatan Rach Mieu. Peserta akan diantar menuju Pulau Unicorn untuk melihat sarang lebah dan menikmati the madu di rumah penduduk lokal. Setelah itu dilanjutkan menuju An Hoa Island dan melakukan workshop permen berbahan dasar kelapa. Disini peserta dapat menaiki kereta kuda di sepanjan jalan desa, beristirahat dan menikmati buah tropis segar sambil mendengarkan music tradisional dari penduduk lokal dan menaiki kapal boat Sampan di sepanjang kanal alami di desa. Kembali ke Saigon dan bersiap-siap penerbangan menuju Danang. Check in hotel dan beristirahat. \r\nBermalam di Fansinan Danang Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:6:\"Danang\";s:9:\"deskripsi\";s:768:\"Sarapan pagi di hotel, Peserta mengunjungi Dragon Bridge. Love Bridge, dan juga Son Tra Peninsula, sebuah daerah hutan lindung seluas 30km2  yang menjadi rumah bagi banyak flora dan fauna di dalamnya. Setelah itu, peserta akan memasuki gua dan melihat patung Bodhisattva disamping Ling Ung Pagoda. Peserta melanjutkan perjalanan menuju Cam Thanh Water Coconut Village. Disini peserta akan menaiki kapal menuju Bay Mau Coconut Forest – Cam Thanh dan belajar cara menangkap kepiting dan membuat benda unik dari daun kelapa. Sore hari, peserta pergi menuju kota tua Hoi An, mengunjungi Japanese Bridge, Chua Ong Pagoda, Chinese Assembly Halls, dan Old House Tan Ky yang berusia 200 tahun. Check in hotel dan beristirahat.\r\nBermalam di Fansinan Danang Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:6:\"Danang\";s:9:\"deskripsi\";s:693:\"Sarapan pagi di hotel, peserta akan pergi ke Ba Na Hills, menaiki cable car dan menikmati pemandangan alam Gunung Ba Na. Peserta akan mengunjungi Le Jardin Wineries, rumah pembuatan wine dari jaman penjajahan Perancis dan Linh Ung Pagoda. Peserta Kembali menaiki cable car menuju puncak dari Gunung Ba Na. Peserta akan masuk dan menikmati taman bermain Fantasy Park Ba Na Hills. Kemudian peserta akan menaiki Peak of Chua Mountain, di ketinggian 1.487m dari permukaan laut dan dilanjutkan dengan mengunjungi Jembatan Emas. Turun kebawah dengan Cable Car dan Kembali ke Kota Danang, berbelanja di Han Market, Kembali ke hotel dan beristirahat \r\nBermalam di di Fansinan Danang Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:16:\"Danang - Jakarta\";s:9:\"deskripsi\";s:284:\"Sarapan pagi di hotel, peserta akan pergi ke Danang International Airport, peserta akan terbang dan transit di Kuala Lumpur International Airport. Dilanjutkan dengan penerbangan menuju Bandara International Soekarno Hatta, tour selesai dan sampai berjumpa di program tour selanjutnya.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:77:\"DAD (12.50) – KUL (16.40) By OD-503 & KUL (18.00) – CGK (19.00) By OD-318\";}}', 'Tiket International Batik Air Malaysia Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) Tiket Domestic Bagasi sesuai dengan ketentuan Airlines (20Kg)Akomodasi hotel *3 dan *4 setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour & makan sesuai program paket tour diatasMineral Water 1 Botol PerhariTour Leader Travel Kits (Luggage Tag)Travel Insurance (sampai usia 84 Tahun)', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"600000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:22:\"SIM Card International\";s:14:\"exclusion_rate\";s:6:\"200000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '6D Vietnam Favorite Danang - Ho Chi Minh.docx', 'Vietnam'),
(49, '2023-09-19 11:06:32', '2023-09-19 11:06:32', '5D EXCITING WINTER SCHOOL HOLIDAY HANOI - HALONG BAY', '5DEWSH3B', 'a:5:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:15:\"Jakarta - Hanoi\";s:9:\"deskripsi\";s:449:\"hari ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Hanoi. Setiba di bandara Noi Bai, Hanoi disambut Guide berbahasa Indonesia yang ramah, kita akan langsung diantarkan ke Stress Train dimana disini kita dapat menikmati coklat panas atau coconut coffee, dilanjutkan menuju Hoan Kiem Lake, The Huc Bridge dan Ngoc Son Temple (photostop).. Check-in Hotel istirahat.\r\nBermalam di Chalcedony Hotel****/similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:156:\"CGK (04.25) – KUL (07.30) by MH 726 & KUL (09:30) – HAN (12.00) by MH752 // CGK (05.25) – SIN (08.10) by SQ 951 & SIN (09.15) – HAN (11.30) by SQ192\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:14:\"Hanoi - Halong\";s:9:\"deskripsi\";s:755:\"Sarapan pagi di hotel. Kita akan menuju Hai Duong sebelum ke dermaga Tuan Chau untuk menaiki Le Journey Cruise, Disini kita akan menikmati berbagai acara yang telah disiapkan oleh pihak Cruise kemudian kita akan menuju Ha Long bay, disini kita dapat menjelajahi Sung Sot Cave yang dikenal dengan Surprise/Amazing Cave, gua terbesar dan terindah di Ha Long Bay. Kembali ke cruise kita akan mengunjungi  Ti Top Island  disini kita dapat melihat keindahan dari teluk Tonkin atau berenang di The emerald Green. Kemudian kembali ke Cruise dan berpastisipasi balam cooking class yang telah disiapkan oleh pihak cruise, pada malam hari disini kita juga dapat karaoke, memancing cumi dan sebagainya. Bermalam di Cruise.\r\nBermalam di Le Journey Cruise ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:14:\"Halong - Hanoi\";s:9:\"deskripsi\";s:384:\"Sarapan pagi, kita akan menaiki kayak untuk menikmati Luon Cave apabila kita beruntung kita dapat berfoto dengan monyet-monyet yang bergelantungan di tebing. Kembali Cruise untuk ke dermaga kemudian kita akan akan Kembali ke Hanoi. Setiba di Hanoi, kita akan berbelanja di Dong Xuan Market dan Hanoi’s Old Quarter. Check-in hotel istirahat.\r\nBermalam di Chalcedony Hotel****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:24:\"Hanoi - Trang An - Hanoi\";s:9:\"deskripsi\";s:515:\"Sarapan pagi di hotel. Kita Akan menuju Trang An, disini kita akan menaiki perahu untuk menikmati Trang An Cave Complex dimana kita akan menelusuri keindahan alam yang sangat luar biasa indah mengunakan perahu, Sang Cave, Toi Cave, Ba Giot Cave, Sinh Cave. Kembali ke Hanoi untuk kita mengunjungi Temple of Literature, Tran Quoc Pagoda yang merupakan salah satu pagoda tertua di Vietnam, selanjutnya kita akan mengunjungi St. Joseph’s Cathedral. Check-in hotel istirahat.\r\nBermalam di Chalcedony Hotel****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:15:\"Hanoi - Jakarta\";s:9:\"deskripsi\";s:143:\"Sarapan Pagi. Waktu bebas sampai tiba waktunya  diantar ke Airport untuk kembali ke Jakarta, dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:154:\"HAN(13.00) – KUL (17.40) by MH 753 & KUL (22:20) – CGK (23.30) by MH727 // HAN(12.35) – SIN (17.15) by SQ 191 & SIN (22.40) – CGK (23.25) by SQ968\";}}', 'Tiket International Jakarta-Hanoi-jakarta by Malaysia Airlines/Singapore Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\nBagasi sesuai dengan ketentuan Airlines \r\nAkomodasi hotel *4 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour & makan sesuai program paket tour diatas\r\nMineral Water 1 Botol Perhari\r\nTour Leader \r\nTravel Kits (Luggage Tag)\r\nTravel Insurance  sampai usia 84 tahun', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"500000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:22:\"SIM Card International\";s:14:\"exclusion_rate\";s:6:\"200000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '5D4N EXCITING VIETNAM MH&SQ.docx', 'Vietnam'),
(50, '2023-09-19 11:31:43', '2023-09-19 11:31:43', '5D FUNTASTIC EARLY YEAR END HOLIDAY SAIGON', '5DFEYESV', 'a:5:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:16:\"Jakarta - Saigon\";s:9:\"deskripsi\";s:489:\"Siang ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Saigon  dengan Malaysia Airlines. Setiba di bandara Tan Son Nhat, Saigon disambut Guide berbahasa Indonesia yang ramah, kita akan langsung diantarkan ke cruise untuk makan malam diiringi musik tradisional.Setelah itu Cruise memulai perjalanan di Sungai Saigon menuju Jembatan Thu Thiem lalu kembali lagi ke Boat Station. Check-in Hotel istirahat.\r\nBermalam di Cecilia Saigon Hotel****/similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:76:\"CGK (09.40) – KUL (12.55) by MH 712 & KUL (14.40) – SGN (15.40) by MH758\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:17:\"Saigon - Vung Tau\";s:9:\"deskripsi\";s:419:\"Sarapan pagi di hotel. Kita akan mengunjungi Kita akan mengunjungi Buu Long Pagoda, yang merupakan pagoda terindah di Vietnam, disini kita juga akan melihat keindahan Gotama Citeya Tower, stupa terbesar di Vietnam. Selanjutnya kita akan mengunjungi Vung Tau yang terdapat Patung raksasa Yesus Kristus yang terbesar di Vietnam.  Makan malam di lokal restoran.Check-in Hotel istirahat.\r\nBermalam di Riva Hotel****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:17:\"Vung Tau - Saigon\";s:9:\"deskripsi\";s:358:\"Sarapan pagi di hotel. Kita Akan menuju Cu Chi untuk mengunjungi Cu Chi Tunnel tempat bersejarah yang merupakan terowongan bawah tanah yang digunakan untuk persembunyian tentara Vietnam pada masa perang Vietnam melawan Amerika. Kembali menuju Saigon dan berbelanja di Ben Thanh Market. Check-in hotel istirahat.\r\nBermalam di Cicilia Saigon Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:30:\"Saigon - Mekong Delta - Saigon\";s:9:\"deskripsi\";s:926:\"Sarapan pagi di hotel. Kita akan menuju Vinh Trang Pagoga setelah sampai kita akan menaiki kapal menelusuri sungai dengan pemandangan rumah panggung, kebun buah dan desa nelayan di pinggiran sungai.  Dilanjutkan menuju Tortoise Islet, makan siang di Orchard Garden, kemudian menaiki perahu sampan menuju An Khanh, dan menikmati seasonal Fruit & Honey Tea sambil menikmati penampilan music lokal “Southtern Vietnamese Folk Music”. Kemudian mengunjungi Family business dan menikmati coconut candy. Dilanjutkan perjalanan menuju Ho Chi Minh sambil menikmati kehidupan sehari hari di daerah Mekong Delta.  Kemudian perjalanan menuju Saigon untuk mengunjungi Dong Khoi Street melewati Rex Hotel, Ho Chi Minh Square, The Hundreds Years Red Cathedral,  dan old post office, kemudian dilanjutkan berbelanja di Ben Thanh Market. Makan malam di lokal restoran. Check-in hotel istirahat.\r\nBermalam di Cecilia Saigon Hotel****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:16:\"Saigon - Jakarta\";s:9:\"deskripsi\";s:143:\"Sarapan Pagi. Waktu bebas sampai tiba waktunya  diantar ke Airport untuk kembali ke Jakarta, dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:78:\"SGN(11.00) – KUL (14.10) by MH 751 & 〉KUL (16.25) – CGK (17.30) by MH723\";}}', 'Tiket International Jakarta-Hanoi-jakarta by Malaysia Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\nBagasi sesuai dengan ketentuan Airlines \r\nAkomodasi hotel *4 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour & makan sesuai program paket tour diatas\r\nMine