an Temple kemudian Kembali ke Wine Cave dilanjutkan menuju Hang Sinh, Si Cave, Ba Giot Cave yang terkenal akan mitos, Ketika kita dapat mendapatkan 3 tetes air maka akan menjadi orang sukses dan lebih dari 3 tetes kita akan penuh akan kebahagiaan. Dilanjutkan dengan mengunjungi Seo Cave, Son Duong Cave, Phu Khong Cave, Khong Cave, Tran Cave, Quy Hau dan Kembali ke dermaga Tran An. Melanjutkan perjalanan kita menuju Phat Diem Stone Church yang merupakan gereja dengan arsitektur campuran dari daerah timur dan barat dengan gaya bentuk bangunannya ala eropa dan atap berbentuk seperti pagoda.  Kembali perjalanan menuju Hanoi. Check-in hotel istirahat.\r\nBermalam di Chalcedony Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:18:\"Hanoi - Halong Bay\";s:9:\"deskripsi\";s:477:\"Sarapan pagi di hotel. Kita akan menuju dermaga Tuan Chau untuk menaiki Le Journey Cruise. Disini kita akan menikmati berbagai acara yang telah disiapkan oleh pihak Cruise kemudian kita akan menuju Lan Ha bay, disini kita dapat menjelajahi Ba Trai Dao – Tra Bau area dengan menggunakan Kayaking (Opsional), kemudian kembali ke Cruise dan berpastisipasi balam cooking class yang telah disiapkan oleh pihak cruise bermalam di Cruise.\r\nBermalam di Le Journey Cruise ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:18:\"Halong Bay - Hanoi\";s:9:\"deskripsi\";s:410:\"Sarapan pagi di hotel, kita akan memulai hari ini dengan senam Tai Chi di sundeck,  kemudian kita akan menuju Sung Sot Cave, salah satu goa terbesar di Halong Bay dengan keindahan stalagnit dan stalagtit. Kembali Cruise untuk ke dermaga kemudian kita akan akan Kembali ke Hanoi. Setelah sampai di Hanoi kita akan menikmati Water Puppet Show. Check-in hotel istirahat.\r\nBermalam di Chalcedon