\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:40:\"SAIGON - MEKONG DELTA (DINNER ON CRUISE)\";s:9:\"deskripsi\";s:985:\"Sarapan pagi di hotel. Kita akan menuju Vinh Trang Pagoda setelah sampai kita akan menaiki kapal menelusuri sungai dengan pemandangan rumah panggung, kebun buah dan desa nelayan di pinggiran sungai.  Dilanjutkan menuju Tortoise Islet, makan siang di Orchard Garden, kemudian menaiki perahu sampan menuju An Khanh, dan menikmati seasonal Fruit & Honey Tea sambil menikmati penampilan music lokal “Southtern Vietnamese Folk Music”. Kemudian mengunjungi Family business dan menikmati coconut candy. Dilanjutkan perjalanan menuju Ho Chi Minh sambil menikmati kehidupan sehari hari di daerah Mekong Delta.  Kemudian perjalanan menuju Saigon, setiba di Saigon kita akan berbelanja di Ben Thanh Market.  Dilanjutkan, Menuju Pelabuhan untuk menikmati pemandangan indah diatas cruise dan makan malam di Cruise, Kita akan disambut dengan aluunan traditional music Vietnam dan Welcom drink. Kemudian Kembali untuk proses Check-in hotel istirahat.\r\nBermalam di Cecilia Saigon Hotel****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:21:\"SAIGON - KUALA LUMPUR\";s:9:\"deskripsi\";s:515:\"Sarapan pagi di hotel. Kita Akan menuju Dong Khoi Street melewati Rex Hotel, Ho Chi Minh Square, The Hundreds Years Red Cathedral,  dan old post office, selanjutnya kita akan Makan siang terlebih dahulu di Local Restaurant. Kemudian kita akan di antar Menuju Airport untuk proses Checkin dan boarding menuju Kuala Lumpur. Kedatangan Kuala Lumpur kita akan langsung menuju Hotel untuk proses Check – in, anda dapat menikmati area Bukit Bintang atau beristirahat.\r\nBermalam di Metro Hotel  Bukit Bintang ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:35:\"SGN(16.40) – KUL (19:45) by MH759\";}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:22:\"KUALA LUMPUR - JAKARTA\";s:9:\"deskripsi\";s:342:\"Sarapan pagi di Hotel kemudian Free Time sampai waktu untuk pengantaran menuju Airport, Kemudian waktu ketibaan untuk pulang kita akan di antar menuju airport dan melanjutkan perjalanan pulang dari Kualalumpur menuju Indonesia menggunakan Malaysia Airlines. Tiba di Jakarta dan Tour Kita Selesai, sampai Jumpa di tour selanjutnya. Terimakasih\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:35:\"KUL(13.40) – CGK (14:45) by MH721\";}}', 'Tiket International Jakarta-Hanoi-jakarta by Malaysia Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\nBagasi sesuai dengan ketentuan Airlines \r\nAkomodasi hotel *4 setaraf di Saigon Dan hotel *3 di Malaysia (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour & makan sesuai program paket tour diatas\r\nMineral Water 1 Botol Perhari\r\nTour Leader \r\nTravel Kits (Luggage Tag)\r\nTravel Insurance  sampai usia 84 tahun', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"600000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:22:\"SIM Card International\";s:14:\"exclusion_rate\";s:6:\"200000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '6D5N UNIQUE NEW YEAR SAIGON CHU CHI TUNNER MH VIETNAM.docx', 'Vietnam'),
(54, '2023-09-20 14:48:42', '2023-09-20 14:48:42', '7D ENJOY 3 COUNTRIES SIN-MAL-THAI', '7D E3C-SMT', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:35:\"Jakarta - Kuala Lumpur - Johor Baru\";s:9:\"deskripsi\";s:643:\"Pagi ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Kuala Lumpur dengan Maskapai Malaysia Airlines. Setiba di Kuala Lumpur kita akan disambut Guide berbahasa Indonesia yang ramah kemudian kita akan langsung  menuju Mallaca untuk mengunjungi Rumah Merah, Christ Church / Gereja Anglican (Photostop) yang di bina pada tahun 1975. Dilanjutkan menuju Famosa (photostop), benteng yang berarsitektur Eropa tertua di Asia, kemudian kita akan berbelanja di Jonker Street (photostop) dan melanjutkan perjalanan menuju Johor Baru. Check-in hotel istirahat.\r\nMenginap di Grand sentosa JB Hotel *** atau setaraf\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:36:\"CGK (11.20) –KUL (14.20)  by MH710\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:37:\"Johor Baru - Singapore - Kuala Lumpur\";s:9:\"deskripsi\";s:422:\"Santap pagi. Kita akan menuju Singapura dan mengunjungi Merlion Park (photostop) kemudian melewati Esplanade, dan Singapore Flyer, Dilanjutkan menuju Garden by The Bay (Photostop) dan Orchard Road (Photostop) selanjutnya kita akan menuju toko souvenir untuk berbelanja oleh-oleh, kemudian kita akan Kembali munuju kota Kuala Lumpur. Check-in hotel istirahat. \r\nMenginap di Pacific Express China Town Hotel *** atau setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:21:\"Kuala Lumpur - Hatyai\";s:9:\"deskripsi\";s:223:\"Santap pagi. Kita akan menuju Istana Negara (Photostop) kemudian dilanjutkan menuju ke perbatasan Malaysia – Thailand untuk menuju Hatyai. Check-in hotel istirahat.\r\nMenginap di Sakura Budget Hatyai Hotel *** atau setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:6:\"Hatyai\";s:9:\"deskripsi\";s:640:\"Santap pagi, Kita akan menuju Songkhla untuk mengunjungi Pantai Samila untuk berfoto di Patung Mermaid kemudian kita akan mengunjungi Patung Budha tidur (Photostop) yang merupakan salah satu patung terbesar didunia. Dilanjutkan berbelanja oleh-oleh khas Thailand di Kaysorn, Nora Plaza barangan kulit, Rumah Madu, dan juga mengunjungi Floating Market (Khusus Weekend). Setelah santap siang kita akan kembali ke hotel dan acara bebas. Disini kita dapat mencoba transportasi Thailand TUK-TUK untuk jalan-jalan dan mencoba berbagai kuliner di Lee Garden Plaza. Check-in hotel istirahat.\r\nMenginap di Sakura Budget Hatyai Hotel *** atau setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:30:\"Hatyai - Penang - Kuala Lumpur\";s:9:\"deskripsi\";s:351:\"Santap pagi, kita akan menuju Kuala Lumpur dengan melewati jalan tol / Highway utara - selatan.  dilanjutkan menuju Penang dengan melewati Jembatan Penang, mengunjungi Fort Cornwallis (Photostop) yang merupakan kota tua yang berbentuk bintang 4 bucu.  Di sore hariCheck-in hotel istirahat.\r\nMenginap di Pacific Express China Town Hotel*** atau setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:22:\"Kuala Lumpur - Genting\";s:9:\"deskripsi\";s:334:\"Santap pagi, Kita akan berbelanja di Chocolate Kingdom. Dilanjutkan menuju Menara Berkembar Petronas (Photostop). Kemudian Batu Cave (Photostop), Genting Premium Outlet, Genting Highland dengan menaiki Cable Car untuk naik ke Sky Avenue Gening. Check-in Hotel Istirahat. \r\nMenginap di Pacific Express China Town Hotel *** atau setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:22:\"Kuala Lumpur - Jakarta\";s:9:\"deskripsi\";s:172:\"Santap pagi, kita akan berbelanja di Mitsui Outlet Park yang terkenal akan barang Branded dengan harga murah dan tiba waktunya  diantar ke Airport untuk kembali ke Jakarta.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:38:\"KUL (21.50) – CGK (23.05)  by MH 727\";}}', 'Tiket International Jakarta-kualalumpur-jakarta by Malaysia Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\nBagasi sesuai dengan ketentuan Airlines \r\nAkomodasi hotel *3 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour & makan sesuai program paket tour diatas\r\nMineral Water 1 Botol Perhari\r\nTour Leader \r\nFREE GENTING CABLE CAR \r\nTravel Kits (Luggage Tag)\r\nTourism Tax Malaysia', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"400000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:22:\"SIM Card International\";s:14:\"exclusion_rate\";s:6:\"200000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '7D6N ENJOY 3 COUNTRIES SIN-MAL-THAI.docx', 'Singapore - Malaysia - Thailand'),
