(56, '2023-09-20 15:40:55', '2023-09-20 15:40:55', '7D SPECIAL NEW ROUTE THAILAND CAMBODIA VIETNAM', '7DSNW-TCV', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:17:\"Jakarta - Bangkok\";s:9:\"deskripsi\";s:572:\"Hari ini kita berkumpul di bandara Seokarno-Hatta untuk berangkat menuju ke Don Mueang Airport Bangkok dengan pesawat Airasia. Setelah sampai di Bangkok, kita akan disambut guide yang ramah, setelah itu anda akan langsung diajak untuk mengunjungi Chaopraya River dilanjutkan makan siang di restoran lokal sebelum kita melanjutkan perjalanan menuju Wat Arun Temple yang terletak di tepi barat sungai Chao Phraya kemudian kita akan berbelanja di MBK Shopping Center dan juga Asiatique Night Market. Check-in hotel Istirahat. \r\nBermalam di Bangkok Thomson hotel*** or similar\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:71:\"CGK (02.40) – DMK (06.15) atau CGK (07.10) – DMK (10.50) by AIRASIA\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:17:\"Bangkok - Pattaya\";s:9:\"deskripsi\";s:516:\"Setelah santap pagi, kita akan menuju Honeybee Farm dilanjutkan berbelanja di Dried food center dan Great and Grand Sweer Destination selanjutnya kita akan makan siang di local restoran, kemudian kita akan menuju Pattaya Floating Market yang merupakan pasar apung pinggir sunga Pattaya disini kita dapat menikmati kuliner khas Thailand, selanjutnya kita akan makan malam di local restoran sebelum menuju Alcazar Cabaret Show (optional). Check-in hotel istirahat.\r\nBermalam di Baron Beach Pattaya Hotel *** or similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:7:\"Pattaya\";s:9:\"deskripsi\";s:435:\"Setelah santap pagi, kita akan menuju Gem Gallery disini kita dapat melihat pembuatan aksesoris khas Thailand dilanjutkan menuju Nongnooch Village untuk kita dapat melihat Thai Traditional Show dan Elephant show, kemudian kita akan menuju Laser Buddha dimana kita dapat melihat sebuah tebing dengan gambar Budhha berlapis emas dilanjutkan menuju Erawadee. Check-in hotel istirahat.\r\nBermalam di Baron Beach Pattaya Hotel *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:28:\"Pattaya - Siem Reap Cambodia\";s:9:\"deskripsi\";s:467:\"Kita akan melanjutkan perjalanan menuju perbatasan Thailand dan Cambodia dengan breakfast box untuk sarapan, kemudian kita akan makan siang di local restoran sebelum melanjutkan perjalanan menuju Siamreap untuk mengunjungi Angkor Wat yang merupakan bangunan keagamaan terbesar di dunia. Setelah makan malam di local restoran kita akan berbelanja di Pun Street Night dan walking street. Check-in hotel istirahat.\r\nBermalam di Siem Reap Royal Empire hotel*** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:40:\"Siem Reap Cambodia - Ho Chi Minh Vietnam\";s:9:\"deskripsi\";s:449:\"Setelah santap pagi, kita akan menuju Kampung Jam untuk makan siang sebelum kita menuju Moc Bai, perbatasan antara Cambodia dengan Vietnam. Selanjutnya kita akan mengunjungi Cu Chi Tunnel tempat bersejarah yang merupakan terowongan bawah tanah yang digunakan untuk persembunyian tentara Vietnam pada masa perang Vietnam melawan Amerika, makan malam di local restoran. Check in hotel istirahat.\r\nBermalam di Ho Chi Minh City Acnos hotel*** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:11:\"Ho Chi Minh\";s:9:\"deskripsi\";s:576:\"Setelah santap pagi, kita akan mengunjungi Thien Hau Temple dilanjutkan menuju Sai Gon Central Post Office, kemudian menuju Saigon Notre-Dame Basilica merupakan sebuah katedral yang terletak di pusat kota Ho Chi Minh yang dibangun oleh colonial Perancis. Selanjutnya kita akan makan siang sebelum mengunjungi Landmark 81, gadung pencakar langit di kota Ho Chi Minh, kemudian kita akan mengunjungi Ho Chi Minh Monument, dilanjutkan berbelanja di Ben Thanh Market dan Saigon Square, makan malam di local restorant.  Setelah itu kita akan diantar menuju airport untuk kepulangan.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:16:\"Saigon - Jakarta\";s:9:\"deskripsi\";s:125:\"Hari ini kita akan sampai di bandara Soekarno Hatta Jakarta. Sampai jumpa di perjalanan menyenangkan bersama kami berikutnya.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}}', 'Tiket International dengan AirAsia Airlines Economy termasuk seluruh taxes(Tiket Grup Fixed Date & No Extend) \r\n Termasuk Bagasi 20 kg \r\nAkomodasi hotel *3 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour &makan sesuai program paket tour diatas\r\nMineral Water 01 Botol Perhari\r\nTour Leader \r\nTravel asuransi sampai usia 69 tahun\r\nLuggage Tag', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"700000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:22:\"SIM Card International\";s:14:\"exclusion_rate\";s:6:\"200000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '7D5N SPECIAL NEW ROUTE 3COUNTRIES (THAILAND-CAMBODIA-VIETNAM) BY QZ(1).docx', 'THAILAND - CAMBODIA - VIETNAM'),
