(58, '2023-09-21 14:36:29', '2023-09-21 14:36:29', '9D BEST OF WINTER NEW YEAR KOREA START KNO', '9DBOWNY-KNO', 'a:9:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:13:\"Medan - Busan\";s:9:\"deskripsi\";s:153:\"Malam ini kita berkumpul di Bandara Kualanamu Medan untuk berangkat menuju ke Busan dengan Maskapai terbaik bintang 5 versi Skytrax.\r\nBermalam di PESAWAT\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:64:\"KNO (2005)- SIN(2235) BY SQ 995 & SIN (2330) – PUS (0630)+1DAY\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:5:\"Busan\";s:9:\"deskripsi\";s:544:\"Setiba di Busan langsung disambut Guide berbahasa Indonesia yang ramah kemudian kita akan langsung mengunjungi Haedong Yonggungsa Temple dimana kuil ini terletak di pinggir pantai, kemudian kita akan menikmati sunset di pantai Haeundae dan menikmati panorama indah Haeundae Beach  dengan Haeundae Beach Train. Hari ini kita juga menikmati panorama indah dan bersejarah di APEX Nurimaru Site. selanjutnya kita akan melewati jembatan Gwangan untuk menikmati pemandangan malam di Busan. Check-in Hotel.  \r\nBermalam di Arban Hotel Busan ***/similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:5:\"Busan\";s:9:\"deskripsi\";s:673:\"Sarapan pagi di hotel. Lalu kita akan berkeliling menaiki Yacht di Busan sebelum kita mengunjungi Oryukdo Skywalk, jembatan kaca yang menjorok ke arah laut membentuk huruf U, dilanjutkan menuju Desa Budaya Gamcheon atau dikenal dengan sebutan Machu Picchu Korea dikarenakan bangunan di desa ini penuh dengan warna warni dan artistic yang dapat memanjakan mata yang melihatnya, kemudian kita akan mengunjungi Yongdusan Park disini kita dapat melihat Busan Tower, lanjutkan berbelanja dan menikmati street food di Biff Busan, tidak hanya itu kita juga akan menikmati jajanan makanan seafood di Jagalchi Market. Check-in Hotel     \r\nBermalam di Arban Hotel Busan *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:20:\"Busan - Nami - Seoul\";s:9:\"deskripsi\";s:290:\"Sarapan pagi di hotel, hari ini kita akan kembali menuju Seoul untuk mengunjungi Nami island yang merupakan tempat syuting dari Winter Sonata, Dilanjutkan melewati Cheonggyecheon Stream untuk menuju Dongdaemun  untuk berbelanja. Check-in Hotel\r\nBermalam di Denim Hotel Gangnam *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:5:\"Seoul\";s:9:\"deskripsi\";s:658:\"Sarapan pagi di hotel,  kita akan mengunjungi dan bermain di taman hiburan Lotte World Theme Park (Include One Day Pass) yang merupakan taman hiburan indoor terbesar di Korea. Kemudian menuju Gangnam COEX Mall, disini kita dapat mengunjungi Starfield Library yang merupakan perpustakaan terbesar dan popular yang berada di tengah pusat perbelanjaan. Dilanjutkan menuju Gangnam K-Star Road dimana pecinta K-pop tidak asing dengan tempat ini dan dapat berfoto dengan berbagai patung beruang bergaya K-pop terkenal. Selanjutnya kita juga akan berbelanja di Gangnam Underground Shopping Center dan Gangnam Garosugil\r\nBermalam di Denim Hotel Gangnam *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:5:\"Seoul\";s:9:\"deskripsi\";s:552:\"Sarapan pagi di hotel,  kita akan National Ginseng Museum, dan K-cosmetic Shop pusat kosmetik terbaik dan nomor 1 di korea, kemudian kita dapat belajar membuat makanan khas dari korea yaitu Kimchi di Making Kimchi, kemudian kita akan melewati Blue House dan mengunjungi Gyeongbokgung Palace, disini kita akan mengenakan hanbok sambil berkeliling. Dilanjutkan menuju Bukchon Hanok Village disana kita dapat melihat rumah tradisional Korea Selatan yaitu Hanok, Dilanjutkan berbelanja 