(60, '2023-09-21 15:10:23', '2023-11-16 11:03:07', '8D PARADISE PREMIUM NEW YEAR HOLIDAY   VIETNAM HANOI HALONG SAIGON', '8DPVH2S', 'a:8:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:25:\"MEDAN KUALANAMU – HANOI\";s:9:\"deskripsi\";s:308:\"Pagi ini kita berkumpul di Bandara Kualanamu untuk berangkat menuju ke Hanoi dengan Singapore Airlines. Setiba di bandara Noi Bai International Airport, Hanoi kita akan disambut oleh Guide yang ramah, kita akan menuju local restoran untuk makan malam.Check-in Hotel \r\nBermalam di Eden Hanoi Hotel****/similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:77:\"KNO (08.40) – SIN (11.20) by SQ  991 & SIN (15.05) – HAN (17.30) by SQ194\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:36:\"HANOI – HALONG OVERNIGHT ON CRUISE\";s:9:\"deskripsi\";s:672:\"Sarapan pagi di hotel. Kita akan mengunjungi The Red River Delta dan berhenti sejenak di Hai Duong sebelum kita menuju dermaga untuk menaiki Le Journey Cruise. Disini kita akan menikmati berbagai acara yang telah disiapkan oleh pihak Cruise seperti mengunjungi Thien Canh Sonh Cave yang berlokasi di puncak dari Gunung,  disini kita dapat melihat keindahan dari teluk Tonkin atau berenang di The emerald Green, Sambil menunggu pergantian tahun baru kita akan mengisi acara kita dengan Demonstrasi memasak Spring Roll Khas Vietnam dan menghias makanan, memancing, karaoke dan berbagai kegiatan lainnya, bermalam di Cruise.\r\nBermalam di La Regina classic cruise ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:27:\"HALONG ACTIVITIES – HANOI\";s:9:\"deskripsi\";s:367:\"Sarapan pagi kemudian kita akan menaiki kayak untuk menikmati Vueng Vieng Floating Fishing Village, salah satu desar terbesar di Halong Bay. Kembali Cruise untuk ke dermaga kemudian kita akan akan Kembali ke Hanoi. Setiba di Hanoi, kita akan berbelanja di Dong Xuan Market dan Hanoi’s Old Quarter. Check-in hotel istirahat.\r\nBermalam di Eden Hanoi Hotel****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:15:\"HANOI CITY TOUR\";s:9:\"deskripsi\";s:428:\"Sarapan pagi di hotel. Setelah itu kita akan mengunjungi St. Joseph’s Cathedral, dan hari ini kita juga akan mengunjungi Ho Chi Minh’s House, His Mausoleum, Ba Dinh Square, One-Pillar Pagoda. Dilanjutkan mengunjungi Buddhist Tran Quoc Pagoda on West lake. Kembali ke Hanoi untuk kita mengunjungi Temple of Literature, Imperial Citadel, dan Mengunjungi Hoan Kim Lake. Check-in Hotel \r\nBermalam di Eden Hanoi Hotel****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:39:\"HANOI FLY TO SAIGON – BUU LONG PAGODA\";s:9:\"deskripsi\";s:507:\"Sarapan pagi di hotel, hari ini kita akan ke bandara untuk penerbangan menuju Saigon. Kemudian kita aja mengunjungi Buu Long Pagoda yang merupakan pagoda terindah di Vietnam, disini kita juga akan melihat keindahan Gotama Citeya Tower, stupa terbesar di Vietnam. Selanjutnya kita akan mengunjungi Tan Dinh pink Cathedral yang merupakan salah satu Gereja yang paling khas di Vietnam berwarna pink, dilanjutkan berbelanja di Ben Thanh Market. Check-in hotel istirahat. \r\nBermalam di Athena hotel  ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:53:\"SAIGON – MEKONG DELTA TOUR – HALF DAY SIGHTSEEING\";s:9:\"deskripsi\";s:779:\"Sarapan pagi di hotel. Kita menuju May Tho untuk menikmati keindahan empat pulau yang ada disana: Dragon,Unicron,Turtle,Phoenix and Rach Mieu Bridge. Selanjutnya kita menuju Thoi Son disini kita dapat menikmati honey tea di rumah penduduk, dilanjutkan menuju pulau An Hao untuk melihat pembuatan coconut candy. Selanjutnya kita akan beristirhat di farm house untuk menikmati buah local sambal mendengarkan music tradisional. Kemudian kita akan menaiki sampan untuk melihat keindahan kanal. Setelah makan siang kita dapat  menaiki sepeda mengelilingi desa. Kembali ke My Tho City untuk menikmati buah kelapa yang segar di kapal dan kembali ke Saigon untuk mengunjungi Saigon Centre Post Office, Notre Dame Catheral. Check-in hotel istirahat\r\nBermalam di Athena hotel  ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:44:\"SAIGON – CU CHI TUNNEL – SAIGON DEPATURE\";s:9:\"deskripsi\";s:327:\"Sarapan pagi di hotel, Kita Akan mengunjungi Cu Chi Tunnel tempat bersejarah yang merupakan terowongan bawah tanah yang digunakan untuk persembunyian tentara Vietnam pada masa perang Vietnam melawan Amerika. Setelah itu kembali ke saigon untuk diantarkan ke Airport untuk kembali ke Medan, transit di Singapore terlebih dahulu.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:36:\"SGN(19.50) – SIN (22.55) by SQ 185\";}i:7;a:7:{s:4:\"hari\";s:1:\"8\";s:6:\"lokasi\";s:15:\"SINGAPORE-MEDAN\";s:9:\"deskripsi\";s:297:\"setelah sampai di Singapore, kita akan mengunjungi Jewel Singapore Changi Airport, dan dapat menikmati panorama indah warna-warni waterfall yang sangat iconic. Sampai waktu untuk keberangkatan lanjutan ke Medan. Berakhirlah tour yang berkesan ini dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:33:\"SIN (07.30) – KNO (07.55) by SQ\";}}', 'Tiket International Jakarta-Hanoi-jakarta by Singapore Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) Bagasi sesuai dengan ketentuan Airlines Akomodasi hotel *4 setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour & makan sesuai program paket tour diatasMineral Water 1 Botol PerhariTour Leader Travel Kits (Luggage Tag)Travel Insurance  sampai usia 84 tahun', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"900000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:22:\"SIM Card International\";s:14:\"exclusion_rate\";s:6:\"200000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '7D6N PARADISE VIETNAM HANOI HALONG SAIGON START MEDAN UPDATE 14NOV (1).docx', 'Vietnam'),
(61, '2023-09-21 15:33:48', '2023-09-21 15:33:48', '7D JOYFUL CHRISTMAS TAIWAN', '7DJCT', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:18:\"Jakarta - Taichung\";s:9:\"deskripsi\";s:633:\"Pagi ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Taiwan dengan Malaysia Airlines. Setiba di bandara TaoYuan International Airport, Taipei kita akan disambut oleh Guide yang ramah, kita akan langsung menuju Taichung untuk mengunjungi Miyahara Ice Cream disini kita dapat menikmati ice cream dengan berbagai rasa, dilanjutkan menuju National Taichung Theater yang merupakan salah satu landmark paling penting di Taicung, bangunan ini di design oleh arsitek terkenal di Jepang. Dilanjutkan berbelanja oleh-oleh di Feng Chia Night Market. Check-in Hotel \r\nBermalam di Gogo Hotel ***/similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:77:\"CGK (04.25) – KUL (07.30) by MH-726 & KUL (09.20) – TPE (14.10) by MH-366\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:26:\"Taichung - Nantou - Chiayi\";s:9:\"deskripsi\";s:395:\"Sarapan pagi di hotel. Kita akan mengunjungi Sun Moon Lake (Termasuk kapal Ferry) yang merupakan danau terbesar di Taiwan. dilanjutkan menuju, Ita Thao Village disini kita dapat mencoba jajanan makanan khas lokal, kemudian kita akan mengunjungi LingZhi Mushroom sebelum menuju Wenwu Temple. Dilanjutkan menuju kota Chiayi. Check-in Hotel istirahat.\r\nBermalam di Maison De Chine Hotel ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:18:\"Chiayi - Kaoshiung\";s:9:\"deskripsi\";s:635:\"Sarapan pagi di hotel. Kita Akan menuju Alishan Forest Recreation disini kita dapat menemukan “Five Wonders” di tempat ini  serperti matahari terbit, lautan awan, matahari terbenam dan kereta hutan. Disini kita juga mengunjungi Sister Pond Sacred Tree, dan juga Three Generation Tree, 3 pohon yang tumbuh di atas pohon sebelumnya. kita juga akan melihat Alishan Railway Station, kereta yang ada di dalam hutan dilanjutkan menuju Tea Shop sebelum menuju kota Kaoshiung, kembali ke hotel, kemudian kita dapat mengunjungi Liuhe/Ruifeng Night market untuk berbelanja. Check-in hotel istirahat.\r\nBermalam di Just Sleep Hotel ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:19:\"Kaoshiung - Taitung\";s:9:\"deskripsi\";s:612:\"Sarapan pagi di hotel. Kita akan mengunjungi Fo Guan Shan Buddha Museum, dilanjutkan menuju DIY Pineapple Cake disini kita dapat mencoba nastar ala Taiwan, kemudian kita akan mengunjungi Lotus Pond Scenic Area atau yang disebut dengan Lianchihtan, disini terdapat Spring & Autumn Pavilion dimana disini kita akan disambut dengan Dragon and Tiger Pagoda dimana terdapat naga dan macan pagoda yang sedang membuka mulut yang dipercaya dapat membuang kesialan dan mendatangkat rejeki kebaikan. Dilanjutkan perjalanan ke Taitung. Check-in Hotel istirahat.\r\nBermalam di Formosan Naruwan Garden Hotel Resort ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:17:\"Taitung - Hualian\";s:9:\"deskripsi\";s:569:\"Sarapan pagi di hotel. Kita Akan menuju HuaLian untuk mengunjungi Taroko national Park yang terkenal akan cadangan marmernya yang melimpah sehingga memperoleh julukan “Jurang Marmer”. Dilanjutkan menuju Eternal Spring Shrine, kuil yang berada di atas tebing yang indah ini merupakan monument untuk mengenang para pahlawan yang mendirikan bangunan tersebut. Kemudian kita akan mengunjungi Tunnel of Nine Turns, dilanjutkan menuju Marble Factory, dilanjutkan berbelanja ke Dongdamen Night Market. Check-in hotel istirahat.\r\nBermalam di Azure Hotel Hualien ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:16:\"Hualian - Taipei\";s:9:\"deskripsi\";s:357:\"Sarapan pagi di hotel. Kita akan menuju Jiufen untuk berbelanja dilanjutkan menuju Duty Free Shop, kemudian menuju Taipei 101 (tidak termasuk Observatory deck) gedung tertinggi kedua didunia, Selanjutnya kita akan mengunjungi night market terbesar dan paling terkenal di Taiwan, Shilin night Market. Check-in Hotel.\r\nBermalam di Papa Whale Hotel ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:12:\"Taipei - Jaa\";s:9:\"deskripsi\";s:338:\"Sarapan pagi di hotel, kita akan memulai hari ini dengan mengunjungi Chai Kai-Shek Memorial Hall, monumen nasional yang dibangun untuk mengenang mantan President Chai Kai-Shek dan kita juga akan melewati Presidential Palace. Sampai tiba waktunya  diantar ke Airport untuk menuju Jakarta, dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:77:\"TPE (15.10) – KUL (20.05) by MH-367 & KUL (22:20) – CGK (23:30) by MH-727\";}}', 'Tiket International Jakarta-Taipei-jakarta by Malaysia Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\nBagasi sesuai dengan ketentuan Airlines \r\nAkomodasi hotel *3 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour & makan sesuai program paket tour diatas\r\nMineral Water 1 Botol Perhari\r\nTour Leader \r\nTravel Kits (Luggage Tag)\r\nTravel Insurance  sampai usia 84 tahun', 'a:3:{i:0;a:3:{s:9:\"exclusion\";s:11:\"Visa Taiwan\";s:14:\"exclusion_rate\";s:6:\"990000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:42:\"Tipping (Local Guide, Driver, Tour Leader)\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:2;a:3:{s:9:\"exclusion\";s:19:\"Modem Wifi Portable\";s:14:\"exclusion_rate\";s:6:\"490000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '7D Joyful Christmas Taiwan.docx', 'TAIWAN'),
(62, '2023-09-21 15:57:36', '2023-09-21 15:57:36', '7D BEST OF NEW WINTER KOREA START SURABAYA', '7DBNWK-S2', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:18:\"Surabaya - Incheon\";s:9:\"deskripsi\";s:252:\"Malam ini kita berkumpul di Bandara Juanda Surabaya untuk berangkat menuju ke Singapore terlebih dahulu. Sesampainya di Singapore, akan melanjutkan penerbangan ke Incheon dengan Singapore Airlines (Maskapai bintang 5 versi Skytrax)\r\nBermalam di PESAWAT\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:81:\"SUB (18.40) – SIN (21.55)  by SQ959 &  SIN (02.25) – iCN (09.50)  by SQ612\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:22:\"Incheon - Nami - Sorak\";s:9:\"deskripsi\";s:381:\"Setiba di Incheon disambut Guide berbahasa Indonesia yang ramah., kita akan mengunjungi Ski Resort (Tidak termasuk peralatan dan pakaian ski). Kemudian kita akan langsung  mengunjungi Nami Island yang merupakan tempat syuting “Winter Sonata” serial drama Korea yang mendunia. Dilanjutkan menuju Mt Sorak. Check in hotel istirahat. \r\nBermalam di Sorak For You Resort ***/similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:17:\"Mt. Sorak - Seoul\";s:9:\"deskripsi\";s:651:\"Sarapan pagi di hotel. Lalu kita akan langsung menuju Gunung Seoraksan, disini kita akan mengunjungi Gwangumsung Fortress Hill(termasuk cable car) , Great Bronze Buddha  Statue, dan juga Sinheungsa Temple. Setelah selesai kita akan perjalanan menuju Seoul dan akan mengunjungi ikon kota Seoul yaitu Namsan Seoul Tower, disini kita dapat meletakkan gembok cinta di Love And Lock,  Setelah selesai kita akan diberi kesempatan untuk mengetahui proses pembuatan rumput laut dan langsung mencicipinya, kita juga akan belajar membuat kimbap, Melewati  Cheonggyecheon Stream Dilanjutkan shopping di Dongdaemun. \r\nBermalam di Denim Hotel Gangnam *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:5:\"Seoul\";s:9:\"deskripsi\";s:653:\"Sarapan pagi di hotel, kita akan melewati Blue House, kemudian mengunjungi Gyeongbok Palace disini kita akan mengenakan Hanbok dan berkeliling, disini anda dipastikan akan mendapat banyak foto yang instagramable. Hari ini juga kita akan mengunjungi Cosmetic Shop Center. Selanjutnya kita mengunjungi Itaewon Mosque dan dapat shalat sejenak di masjid terkenal di Korea, bagi yang non muslim dapat mengunjungi Noksapyeong Street, jalanan Itaewon yang sangat terkenal pada drama “Itaewon Class”. Hari ini kita juga akan mengunjungi Gangnam COEX Mall, disini terdapat Starfield Library yang sangat indah.  \r\nBermalam di Denim Hotel Gangnam *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:14:\"Seoul Free Day\";s:9:\"deskripsi\";s:118:\"Sarapan pagi di hotel, Hari ini kita bebas pergi kemana saja kita mau. \r\nBermalam di Denim Hotel Gangnam *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:17:\"Seoul - Singapore\";s:9:\"deskripsi\";s:540:\"Sarapan pagi di hotel, kita akan Setelah itu kita akan mengunjungi Hongdae Youth Avenue, distrik ramai yang menjual berbagai macam barang unik khas Korea. Hari ini juga kita akan mengunjungi Duty Free Shop, tempat belanja barang brand ternama dengan harga murah bebas pajak. Lalu kita akan mengunjungi Ginseng Museum dan Amethyst Factory. Hari ini kita akan mengunjung Myeongdong, pusat belanja komestik dan street food Korea. Santap malam, lalu kita akan mengunjungi Local Supermarket untuk berbelanja oleh-oleh sebelum ke Incheon Airport.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:37:\"ICN (23.15) – SIN (04.55)  by SQ605\";}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:20:\"Singapore - Surabaya\";s:9:\"deskripsi\";s:145:\"Hari ini kita akan melanjutkan perjalanan ke Surabaya dengan waktu transit yang sangat singkat dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:37:\"SIN (07.50) – SUB (09.05)  by SQ922\";}}', 'Tiket International Surabaya-Incheon by Singapore Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\nBagasi 25 kg sesuai dengan ketentuan Airlines \r\nAkomodasi hotel *3 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour & makan sesuai program paket tour diatas\r\nMineral Water 01 Botol Perhari\r\nTour Leader \r\nTravel Kits (Luggage Tag)\r\nTravel Insurance  sampai usia 84 tahun', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:16:\"VISA GROUP KOREA\";s:14:\"exclusion_rate\";s:6:\"625000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:17:\"Visa Single Korea\";s:14:\"exclusion_rate\";s:6:\"980000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:34:\"Tipping Guide, Driver, Tour Leader\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:3;a:3:{s:9:\"exclusion\";s:10:\"Modem Wifi\";s:14:\"exclusion_rate\";s:6:\"490000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, 'BEST OF NEW KOREA 7D SQ START SURABAYA (1).docx', 'KOREA'),
(63, '2023-09-22 15:49:15', '2023-09-22 15:49:15', '5D SPECIAL MANILA POPULAR', '5DSMP', 'a:5:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:16:\"Jakarta - Manila\";s:9:\"deskripsi\";s:624:\"Hari ini kita berkumpul di Bandara Seokarno-Hatta untuk berangkat menuju ke Manila. Sesampainya di Ninoy Aquino International Airport (MNL), kita akan bertemu dengan guide dan menuju Bonifacio High Street disini kita dapat berbelanja, dilanjutkan menuju American Cemetery yang merupakan tempat memorial bagi tantara Amerika Serikat yang gugur saat perang Dunia II di Filipina pada saat melawan Jepang. Kemudian dilanjuitkan menuju Veniz Grand Canal dimana terdapat kanal di dalam Mall dan kita dapat menaiki kapan di dalam mall tersebut (optional). Check-in Hotel istirahat.\r\nBermalam di Hotel Kimberly Manila *** or similar\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:75:\"CGK (04:25) - KUL (07:30) BY MH 726 & KUL (08:30) – MNL (12:20) BY MH 806\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:6:\"Manila\";s:9:\"deskripsi\";s:535:\"Setelah santap pagi, kita akan City Tour Intramuros yang merupakan kawasan kota tua di Filipina dimana Kawasan seluas 64hektar dikelilingi oleh dinding yang berisikan ragam spot wisata yang mengilustrasikan perkembangan Filipina dari masa ke masa Disini kita dapat mengunjungi Manila Catheral, Plaza de Governador, San Agustin Church dan Casa Manila. Kemudian dilanjutkan menuju Okada Manila Fountain Show untuk dapat menyaksikan pertunjukan lampu air mancur. Check in hotel istirahat.\r\nBermalam di Hotel Kimberly Manila *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:6:\"Manila\";s:9:\"deskripsi\";s:367:\"Setelah santap pagi, kita akan seharian menikmati Manila Ocean Park yang merupakan Marine Theme Park pertama di filipina, disini kita dapat menikmati pertunjukan hiu dan lumba-lumba. Kemudian dilanjutkan menuju Okada Manila Fountain Show untuk dapat menyaksikan pertunjukan lampu air mancur. Check in hotel istirahat.\r\nBermalam di Hotel Kimberly Manila *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:14:\"Villa Escudera\";s:9:\"deskripsi\";s:299:\"Setelah santap pagi, kita akan mengunjungi Villa Escudera, Disini kita akan menikmati Carabao Cart Rides, mengeskplorasi fasilitas rekreasi diluar ruangan dan mencoba pengalaman baru dengan makan siang di lokasi air terjun. Check-in Hotel istirahat. \r\nBermalam di Hotel Kimberly Manila*** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:16:\"Manila - Jakarta\";s:9:\"deskripsi\";s:212:\"Setelah santap pagi, kita akan menuju Duty Free dan Mall of Asia untuk kita dapat berbelanja oleh-oleh sebelum menuju Bandara untuk Kembali Jakarta. Sampai jumpa di perjalanan menyenangkan bersama kami berikutnya\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:75:\"MNL (17:20) - KUL (21:20) BY MH 705 & KUL (22:20) – CGK (23:30) BY MH 727\";}}', 'Tiket International Jakarta-Manila/ Manila-Jakarta dengan Malaysia Airlines, Economy termasuk seluruh taxes(Tiket Grup Fixed Date & No Extend) \r\n Bagasi sesuai dengan ketentuan Airlines\r\nAkomodasi hotel *3/*4 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour &makan sesuai program paket tour diatas\r\nMineral Water 01 Botol Perhari\r\nTour Leader \r\nTravel asuransi\r\nLuggage Tag', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"500000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:22:\"SIM Card International\";s:14:\"exclusion_rate\";s:6:\"200000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', 'Poster Manila.jpeg', '5D MANILA POPULAR.docx', 'Philippines');
