(64, '2023-09-22 16:10:01', '2023-09-22 16:10:01', '7D BEST OF HOKKAIDO JAPAN', '7DBOH', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:17:\"Jakarta - Chitose\";s:9:\"deskripsi\";s:160:\"Malam ini kita berkumpul di bandara Seokarno-Hatta untuk berangkat menuju ke Chitose, Hokkaido dengan Premium Airlines, All Nippon Airways.\r\nBermalam di pesawat\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:77:\"CGK (21.45) – HND (06.50) By NH-856 & HND (09.00) – CTS (10.35) By NH-055\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:19:\"Chitose - Asahikawa\";s:9:\"deskripsi\";s:617:\"Setelah sampai di Chitose, kita akan disambut guide yang ramah, setelah itu anda akan langsung diajak untuk perjalanan ke wilayah Asahikawa dan mengunjungi Asahiyama Zoo, sebuah kebun binatang dengan lokasi paling utara di Jepang yang mempunyai sekitar 750 binatang dari 124 spesies hewan di dalamnya. Asahiyama Zoo juga popular dengan hewan yang berhabitat asli di wilayah yang dingin seperti penguin, anjing laut, beruang kutub, dan lain-lain. Disini peserta dapat menikmati Penguin Show. Setelah itu kita akan pergi menuju Ramen Museum. Check-in hotel dan istirahat.\r\nBermalam di Asahikawa Art Hotel *** or similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:19:\"Asahikawa - Sapporo\";s:9:\"deskripsi\";s:904:\"Setelah santap pagi, kita akan menuju Sapporo dan mengunjungi Shiroi Koibito Park serta Ishiya Chocolate Factory, tempat atraksi wisata yang menyajikan pembuatan dari cokelat terkenal Shiroi Koibito dan kue-kue manis yang terkenal di Jepang. Disini peserta dapat menyaksikan langsung proses pembuatan dan menikmati kue dan cokelatnya.  Kemudian kita melanjutkan perjalanan ke Sapporo TV Tower dan Odori Park, sebuah kebun terkenal di kota Sapporo yang selalu digunakan untuk tempat festival musim panas dan festival musim salju (Periode Akhir November – Awal Maret, kita dapat menikmati pemandangan kota Sapporo berwarna putih salju). Dilanjutkan dengan kunjungan ke Clock Tower, Menara jam tertua di Jepang yang terbuat dari struktur bangunan kayu. Sore hari, kita akan pergi menuju Susukino & Tanukijoji untuk berbelanja. Check-in hotel dan istirahat.\r\nBermalam di Sapporo T-Mart Hotel *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:33:\"Sapporo - Noboribetsu - Lake Toya\";s:9:\"deskripsi\";s:784:\"Setelah santap pagi, kita akan pergi menuju Noboribetsu Jigokudani Hell Valley, sebuah lembah yang terbentuk akibat letusan vulkanik 20 ribu tahun yang lalu. Saat ini, area seluas 24 hektar dengan pemandangan alam yang indah ini masih aktif secara geothermal/ panas bumi yang dapat terlihat dari adanya kolam belerang dan sungai air panas. Dilanjutkan dengan menuju Mt. Showa lalu kita mengunjungi Bear Farm, Tempat penangkaran khusus beruang terutama Beruang Cokelat, yang dianggap dewa oleh penduduk asli Hokkaido. Setelah itu kita pergi menuju Noboribetsu Takimoto inn atau Toyako Kohantei Hotel. Check in Hotel, kita akan makan malam, menggunakan Yukata dan dapat menikmati Onsen di hotel lalu istirahat.\r\nBermalam di Noboribetsu Takimoto Inn/ Toyako Kohantei Hotel *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:19:\"Lake Toya - Sapporo\";s:9:\"deskripsi\";s:681:\"Setelah santap pagi. Kita akan mengunjungi Lake Toya, danau sedalam 180m yang terkenal dengan danau di utara Jepang yang tidak pernah membeku dengan pulau di tengahnya. Kemudian kita akan pergi menuju Noboribetsu Date Jidaimura, sebuah theme park dengan tema kehidupan bergaya masa Edo (1603 – 1868 Masehi), periode dimana Jepang dipimpin dengan Kediktatoran Militer/ Shogunate dan terisolasi dari komunikasi dengan dunia luar. Disini peserta dapat menikmati permainan, belajar kehidupan masa edo, makan makanan tradisional, dan lain-lain. Sore hari, peserta kembali ke kota Sapporo untuk berbelanja. Check-in hotel dan istirahat.\r\nBermalam di Sapporo T-Mart Hotel *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:23:\"Sapporo - Otaru - Tokyo\";s:9:\"deskripsi\";s:722:\"Setelah santap pagi, kita akan mengunjungi Kanal Otaru, sebuah kanal yang terinspirasi dari Kota Venice Italia, yang dikelilingi oleh Gedung Gedung tua bekas Gudang, yang sudah direnovasi supaya terlihat lebih indah.  Selanjutnya kita akan mengunjungi Music Box Museum, Toko Musik Box terbesar di Jepang yang menjual sekitar 80.000 kotak musik dari 5.000 jenis yang berbeda. Kemudian kita akan mengunjungi Kitaichi Glass Factory, toko yang menjual barang-barang terbuat dari kaca, yang mempunyai 3 jenis gaya toko, yaitu gaya Jepang, gaya Eropa, dan gaya pedesaan. Perjalanan dilanjutkan menuju Rera Outlet Factory. Setelah itu, kita akan diantar menuju Chitose Airport untuk penerbangan menuju Haneda. Bermalam di pesawat\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:37:\"CTS (20.30) – HND (22.10) by NH-082\";}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:15:\"Tokyo - Jakarta\";s:9:\"deskripsi\";s:143:\"Setelah tiba di Haneda Airport, kita bersiap-siap untuk Kembali ke tanah air. Sampai jumpa di perjalanan menyenangkan bersama kami selanjutnya.\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}}', 'Tiket International Jakarta-Chitose/ Chitose-Jakarta dengan All Nippon Airways, Economy termasuk seluruh taxes (Tiket Grup Fixed Date & No Extend) \r\n Bagasi 23 kg per orang atau sesuai dengan ketentuan Airlines\r\nAkomodasi hotel *3 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour &makan sesuai program paket tour diatas\r\nMineral Water 01 Botol Perhari\r\nTour Leader \r\nTravel Insurance sampai usia 84 tahun\r\nLuggage Tag', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:19:\"Modem Wifi Portable\";s:14:\"exclusion_rate\";s:5:\"70000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', 'Poster Hokkaido.jpeg', '7D Best of Hokkaido Jepang .docx', 'Japan'),
(65, '2023-09-26 11:37:04', '2023-09-26 11:37:04', 'TEST BOOKING', 'TEST', 'a:1:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:4:\"TEST\";s:9:\"deskripsi\";s:4:\"TEST\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}}', 'TEST', 'a:1:{i:0;a:3:{s:9:\"exclusion\";s:3:\"TIP\";s:14:\"exclusion_rate\";s:3:\"100\";s:14:\"exclusion_type\";s:9:\"mandatory\";}}', NULL, NULL, 'TEST'),
(66, '2023-10-17 14:31:18', '2023-10-17 14:31:18', '6D EXCITING BLOSSOM LEBARAN HOLIDAY KOREA + EVERLAND', '6DELHK - EVL', 'a:6:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:17:\"Jakarta - Incheon\";s:9:\"deskripsi\";s:213:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Incheon secara langsung dengan Maskapai premium direct flight dengan Garuda Indonesia Airlines.\r\nBermalam di PESAWAT\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:58:\"CGK (23.15) -ICN (08.30)+1DAY  by GA878=> Garuda Indonesia\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:22:\"Incheon - Nami - Sorak\";s:9:\"deskripsi\";s:403:\"Setiba di Incheon disambut Guide berbahasa Indonesia yang ramah, kita akan mengunjungi Songdo Central Park, panorama perkotaan baru di Incheon. Kemudian, kita akan mengunjungi menuju Nami Island yang merupakan tempat syuting “Winter Sonata” serial drama Korea yang mendunia. Kemudian Dilanjutkan menuju Mt Sorak.  Setelah itu, Check in hotel istirahat. \r\nBermalam di Sorak For You Resort ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:13:\"Sorak - Seoul\";s:9:\"deskripsi\";s:538:\"Sarapan pagi di hotel. Lalu kita akan tour menuju MT. Sorak mengunjungi Gwangumsung Fortress Hill(termasuk cable car) , Great Bronze Buddha  Statue, Sinheungsa Temple. kemudian kita akan melewati Blue House dan mengunjungi Gyeongbokgung Palace & National Folk Village, disini kita akan mengenakan hanbok sambal berkeliling, kemudian Kita juga dapat membuat makanan traditional Korea Selatan yaitu kimchi di Making kimbap. Dilanjutkan shopping di Dongdaemun. Check-in hotel istirahat\r\nBermalam di Golden City Dongdaemun Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:5:\"Seoul\";s:9:\"deskripsi\";s:518:\"Sarapan pagi di hotel, kita akan mengunjungi National Gingseng Museum, dilanjutkan ke K-Cosmetic Shop. Hari ini kita juga akan mengunjungi Itaewon Mosque bagi yang muslim atau bagi yang non Muslim dapat mengunjungi jalan terkenal di film Itaewon Class, yaitu Noksapyeong Street. Kemudian kita akan mengunjungi dan bermain di taman hiburan Everland Theme Park (Include One Day Pass) yang merupakan taman hiburan indoor terbesar di Korea. Check-in hotel Istirahat.\r\nBermalam di Golden City Dongdaemun Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:5:\"Seoul\";s:9:\"deskripsi\";s:502:\"Setelah Santap pagi. Kita akan mengunjungi Health Care Shop (Red Pine Tree), Amethyst Show case. Hari ini kita akan mengunjungi HIKR Ground, disini kita akan berfoto bak artis K-Pop. Kemudian menuju Gangnam COEX Mall, disini kita dapat mengunjungi Starfield Library yang merupakan perpustakaan terbesar dan popular yang berada di tengah pusat perbelanjaan. Dilanjutkan berbelanja di Duty Free Shop dan Myeongdong Street. Check-in Hotel istirahat.\r\nBermalam di Golden City Dongdaemun Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:15:\"Seoul - Jakarta\";s:9:\"deskripsi\";s:213:\"Sarapan pagi, lalu mengunjungi Local Supermarket untuk berbelanja oleh-oleh sebelum ke Incheon Airport. Tiba waktunya  diantar ke Airport untuk kembali ke Jakarta, dan sampai jumpa di tour selanjutnya bersama kami\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:55:\"ICN (10.35) - CGK (15.35)  by GA879 => Garuda Indonesia\";}}', '✔	 Tiket International Jakarta-Incheon by Garuda Indonesia (Premium Airlines), Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\n✔	Bagasi sesuai dengan ketentuan Airlines \r\n