\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:15:\"Tokyo - Jakarta\";s:9:\"deskripsi\";s:186:\"Hari ini setelah makan pagi, kita akan diantarkan ke airport untuk perjalanan kembali ke bandara Soekarno Hatta Jakarta.  Sampai jumpa di perjalanan menyenangkan bersama kami berikutnya.\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:81:\"NRT (10.05)  – KUL (17.05)  by MH089  KUL (22.20) – CGK (23.30) byMH727\";}}', '✔	Tiket International Jakarta-Osaka/ Narita-Jakarta dengan Malaysia Airlines, Economy termasuk seluruh taxes(Tiket Grup Fixed Date & No Extend) ✔	 Bagasi 30 kg per orang atau sesuai dengan ketentuan Airlines✔	Akomodasi hotel *3/*4 setaraf (Twin / Triple)✔	Transportasi bus Pariwisata & tiket masuk objek wisata✔	Acara Tour &makan sesuai program paket tour diatas✔	Mineral Water 01 Botol Perhari✔	Tour Leader ✔	Travel asuransi✔	Lugage Tag', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:20:\"Visa Jepang (Single)\";s:14:\"exclusion_rate\";s:6:\"800000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:11:\"Visa Waiver\";s:14:\"exclusion_rate\";s:6:\"275000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:19:\"Modem Wifi Portable\";s:14:\"exclusion_rate\";s:6:\"490000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:3;a:3:{s:9:\"exclusion\";s:34:\"TIPPING TOUR LEADER, GUIDE, DRIVER\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}}', 'ADORABLE LEBARAN HOLIDAY GOLDEN ROUTE JAPAN 7D.jpg', 'ADORABLE LEBARAN HOLIDAY GOLDEN ROUTE JAPAN 7D 2023 MH 12APR (2).docx', 'Japan'),
(70, '2023-10-19 15:40:09', '2023-10-19 15:40:09', '6D PEAK BLOSSOM KOREA BY SQ', '6PBK', 'a:6:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:17:\"Jakarta - Incheon\";s:9:\"deskripsi\";s:159:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Incheon Maskapai bintang 5 versi Skytrax.\r\nBermalam di PESAWAT\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:81:\"CGK (19.00) – SIN (21.50)  by SQ965 &  SIN (00.10) – SIN (07.45)  by SQ608\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:22:\"Incheon - Nami - Sorak\";s:9:\"deskripsi\";s:689:\"Setiba di Incheon disambut Guide berbahasa Indonesia yang ramah kemudian kita akan langsung  mengunjungi Pochen Bidulginang Falls, berada di arah timur laut Seoul. Disini kita dapat menemukan “raksasa-raksasa yang terlupakan” yaitu lima patung dari bahan daur ulang karya seniman Denmark Thomas Dambo. Kita langsung menuju salah satu tempat syuting drama “Crash Landing On You“ yaitu Pocheon Hangtang River Sky Bridge, (Tidak termasuk pakaian dan perlengkapan ski). Dilanjutkan menuju Nami Island yang merupakan tempat syuting “Winter Sonata” serial drama Korea yang mendunia. Dilanjutkan menuju Mt Sorak. Check in hotel istirahat. \r\nBermalam di Sorak I-Park Resort ***/similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:13:\"Sorak - Seoul\";s:9:\"deskripsi\";s:442:\"Sarapan pagi di hotel. Lalu kita akan tour menuju Gunung Sorak mengunjungi Gwangumsung Fortress Hill(termasuk cable car) , Great Bronze Buddha  Statue, Sinheungsa Temple. Setelah selesai kita akan diberi kesempatan untuk mengetahui proses pembuatan rumput laut dan langsung mencicipinya, kita juga akan belajar membuat kimbap , Melewati  Cheonggyecheon Stream, Dilanjutkan shopping di Dongdaemun. \r\nBermalam di Park Habio Hotel  *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:5:\"Seoul\";s:9:\"deskripsi\";s:708:\"Sarapan pagi di hotel, hari ini kita akan memiliki kesempatan mengunjungi pusat kosmetik local Korea. Hari ini kita juga akan mengunjungi Bukchon Hanok Village. Selanjutnya kita mengunjungi Itaewon Mosque dan dapat shalat sejenak di masjid terkenal di Korea, bagi yang non muslim dapat berjalan-jalan di Noksapyeong Street jalanan Itaewon yang sangat terkenal pada drama “Itaewon Class”. Hari ini kita juga akan mengunjungi Haneul Park, Untuk spot blossom terbaik. (spot blossom tentative sesuai kondisi). Setelah itu bagi penggemar kita akan mengunjungi COEX Mall, dimana disini terdapat Starfield Library yang sangat ikonik dan instagramable untuk berfoto. \r\nBermalam di Park Habio Hotel  *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:5:\"Seoul\";s:9:\"deskripsi\";s:588:\"Sarapan pagi di hotel, kita akan melewati Blue House, kemudian kita akan mencoba menggunakan Hanbok (Baju tradisional korea) dan mengelilingi Gyeongbok Palace. Hari ini juga kita akan shopping tour di Ginseng Museum, Red Pine Shop, Duty Free Shop, Amethyst Showcase, hari ini juga kita dapat mengunjungi ikon kota Seoul N Seoul Tower & Love Lock disini ada dapat meletakkan gembok cinta anda disini dan shopping di Myeongdong Street. Setelah itu kita akan mengunjungi Local Supermarket Sebelum ke bandara untuk berbelanja snack. Tiba waktunya  diantar ke Airport untuk kembali ke Jakarta.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:37:\"ICN (23.15) – SIN (04.55)  by SQ605\";}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:15:\"Seoul - Jakarta\";s:9:\"deskripsi\";s:140:\"Hari ini kita akan melanjutkan penerbangan ke Jakarta. Berakhirlah tour yang berkesan ini dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:37:\"SIN (06.50) – CGK (07.35)  by SQ950\";}}', 'Tiket International Jakarta-Incheon by Singapore Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\nBagasi sesuai dengan ketentuan Airlines \r\nAkomodasi hotel *3 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour & makan sesuai program paket tour diatas\r\nMineral Water 1 Botol Perhari\r\nTour Leader \r\nTravel Insurance', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:16:\"VISA GROUP KOREA\";s:14:\"exclusion_rate\";s:6:\"625000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:17:\"Visa Single Korea\";s:14:\"exclusion_rate\";s:6:\"980000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:34:\"Tipping Guide, Driver, Tour Leader\";s:14:\"exclusion_rate\";s:6:\"690000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:3;a:3:{s:9:\"exclusion\";s:10:\"Modem Wifi\";s:14:\"exclusion_rate\";s:6:\"420000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, 'PEAK BLOSSOM KOREA 6D SQ 2 APR.docx', 'Korea'),
