(72, '2023-10-19 16:13:22', '2023-11-07 15:50:38', '8D BEAUTIFUL EID MUBARAK SAKURA JAPAN + TDS BY GA', '8DEMJ - TDS', 'a:8:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:15:\"Jakarta - Tokyo\";s:9:\"deskripsi\";s:154:\"Malam ini kita berkumpul di bandara Soekarno-Hatta untuk berangkat menuju ke Haneda, Tokyo dengan Premium Airlines, Garuda Indonesia.\r\nBermalam di pesawat\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:37:\"CGK (23.35) – HND (08.50) By GA-874\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:5:\"Tokyo\";s:9:\"deskripsi\";s:793:\"Sesampainya di Haneda, kita akan disambut guide, setelah itu anda akan langsung diajak untuk melakukan perjalanan mengunjun Imperial Palace, yang merupakan kediaman kekaisaran Jepang. Kemudian, anda akan mengunjungi Tokyo Sky Tree (photostop) yang merupakan salah satu landmark terkenal yang ada di Tokyo. Selanjutnya kita akan menuju ke Ginza yang merupakan salah satu pusat perbelanjaan terkenal di Tokyo. Selanjutnya kita akan mengunjungi Asakusa Kannon Temple yang merupakan kuil tertua di Tokyo. Kemudian, kita akan menikmati keindahan bunga sakura di Ueno Park. Setelah puas menikmati keindahan bunga sakura di ueno park anda akan kami ajak untuk berkunjung ke Shinjuku sebelum makan malam di local resto. Check-in hotel dan istirahat\r\nBermalam di Tokyo T Mark Hotel Omori *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:44:\"Tokyo - Mt. Fuji - Oshino Hakkai - Kawaguchi\";s:9:\"deskripsi\";s:699:\"Setelah sarapan, kita akan mengunjungi Gunung Fuji yang merupakan gunung terindah dan tertinggi di Jepang, sampai 5th station (jika cuaca mendukung) Kemudian, kita akan menuju  Oshino Hakkai Village di sini anda dapat menikmati suasana desa di jepang yang terkenal akan 8 sumber mata air alaminya. Setelah itu, kita akan mengunjungi Iyashino Sato Nenba yang merupakan desa tradisional Jepang dengan gaya arsitekturnya yang unik. Kemudian, kita akan menuju Lake Kawaguhi di sini kita dapat bersantai sambil berswafoto dengan pemandangan Gunung Fuji yang indah. Check-in hotel, menggunakan Yukata dan dapat menikmati Onsen di hotel lalu istirahat.\r\nBermalam di Kawaguchiko Jiragon Hotel *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:26:\"Kawaguchi - Hakone - Tokyo\";s:9:\"deskripsi\";s:689:\"Setelah sarapan, hari ini anda akan mengunjungi Owakudani Sulphurous Pond yang merupakan daerah kawah yang tercipta dari letusan gunung Hakone 3000 tahun lalu dengan panorama keindahan alam dan juga kolam belerangnya. Selesai dari owakudani, kita akan bisa bersantai sambil menikmati pemandangan dengan menulusuri sepanjang Lake Ashi (Termasuk Cruise). Setelah itu kita akan mengunjungi Arakuyama Sengen Park dan mengunjungi Chureito Pagoda di sini kita dapat menikmati keindahan serta berswafoto dengan pemandangan Gunung Fuji dan Pagoda Chureito serta bunga sakura yang sangant ikonik. kembali ke Tokyo. Check-in hotel dan istirahat. \r\nBermalam di Tokyo T Mark Hotel Omori *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:16:\"Tokyo - Yokohama\";s:9:\"deskripsi\";s:526:\"Setelah sarapan, hari ini kita akan mengunjungi Yokohama Ramen Museum yang merupakan museum bertemakan Ramen yang di dalamnya kita dapat merasakan replika kota tua Jepang dengan vibes tahun 1950-an. Setelah itu anda akan mengunjungi Yokohama China Town yang terkenal dan dapat berbelanja di Motomachi shopping arcade. Selesai berbelanja kita akan menuju Odaiba melewati Rainbow Bridge disini terdapat monument liberty dan juga monument gundam. Check-in hotel dan istirahat.\r\nBermalam di Tokyo T Mark Hotel Omori *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:22:\"Tokyo - Shinjuku Gyoen\";s:9:\"deskripsi\";s:659:\"Setelah sarapan, kita akan mengunjungi Kawagoe Old Town sebuah daerah di Saitama yang terkenal akan suasananya yang terasa seperti zaman Edo dan kita dapat mengeksplorasi warisan budaya Jepang yang klasik. Setelah dari Kawagoe old town, anda akan kami ajak berkunjung ke Shinjuku Gyoen yang merupakan destinasi favorit pada musim semi di Jepang karena keindahan bunga sakuranya di taman tersebut. Kemudian anda akan berkunjung ke Shibuya yaitu distrik perbelanjaan terkemuka di Jepang disini terdapat ikon dengan monumen Hachiko yang sangat terkenal sebagai anjing yang setia. Check-in hotel dan istirahat.\r\nBermalam di Tokyo T Mark Hotel Omori *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:5:\"Tokyo\";s:9:\"deskripsi\";s:351:\"Setelah sarapan, hari ini anda akan diajak untuk mengunjungi salah satu themepark yang terkenal di Jepang yaitu Tokyo Disneyland yang merupakan taman hiburan Disney pertama yang dibangun di luar Amerika Serikat (Termasuk One Day Pass) dengan pengalaman menggunakan subway. Check in hotel istirahat.\r\nBermalam di Tokyo T Mark Hotel Omori *** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:7;a:7:{s:4:\"hari\";s:1:\"8\";s:6:\"lokasi\";s:15:\"Tokyo - Jakarta\";s:9:\"deskripsi\";s:215:\"Setelah sarapan. Hari ini anda akan kami antarkan ke bandara Haneda, Tokyo untuk persiapan pulang kembali ke Jakarta dan sampai di Jakarta malam hari. Sampai jumpa di perjalanan menyenangkan bersama kami berikutnya.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:37:\"HND (11.45) – CGK (17.50) by GA-875\";}}', 'Tiket International Jakarta-Chitose/ Chitose-Jakarta dengan All Nippon Airways, Economy termasuk seluruh taxes (Tiket Grup Fixed Date & No Extend)  Bagasi 23 kg per orang atau sesuai dengan ketentuan AirlinesAkomodasi hotel *3 setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour &makan sesuai program paket tour diatasMineral Water 01 Botol PerhariTour Leader Travel Insurance sampai usia 84 tahunLuggage Tag', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:20:\"Visa Jepang (Single)\";s:14:\"exclusion_rate\";s:6:\"800000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:11:\"Visa Waiver\";s:14:\"exclusion_rate\";s:6:\"275000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:34:\"Tipping Guide, Driver, Tour Leader\";s:14:\"exclusion_rate\";s:6:\"920000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:3;a:3:{s:9:\"exclusion\";s:10:\"Modem Wifi\";s:14:\"exclusion_rate\";s:6:\"560000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, '8D BEAUTIFUL EID MUBARAK SAKURA JAPAN + TOKYO DISNEYLAND (2).docx', 'Japan');
