(73, '2023-10-20 14:04:52', '2023-10-20 14:04:52', '7D TOKYO EID MUBARAK WITH ONSEN EXPERIENCE + TDS', '7DTIM - OETDS', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:15:\"Jakarta - Tokyo\";s:9:\"deskripsi\";s:136:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta untuk berangkat menuju ke Tokyo dengan pesawat Garuda Indonesia.\r\nBermalam di PESAWAT\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:39:\"CGK (23.35)  - HND (08.50) by GA 874\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:5:\"Tokyo\";s:9:\"deskripsi\";s:634:\"Setiba di Tokyo disambut Guide yang ramah, kemudian mengunjungi The Imperial Place yang merupakan kediaman utama keluarga Kaisar Jepang. Dilanjutkan menuju Tokyo Tower Menara Tertinggi di Jepang kemudian kita akan berbelanja oleh-oleh di Ginza. Selanjutnya kita akan menuju Asakusa Kannon Temple atau yang dilebih dikenal dengan Sensoji merupakan salah satu kuil yang paling popular. Kita juga akan menikmati keindahan taman Ueno Park dan apabila beruntung kita dapat menikmati mekarnya bunga Sakura disini. Selanjutnya kita akan berbelanja di Shinjuku. Check-in Hotel Istirahat\r\nBermalam di Tmark City Hotel Tokyo Omori*** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:33:\"Tokyo - Mt. Fuji - Lake Kawaguchi\";s:9:\"deskripsi\";s:582:\"Setelah sarapan pagi, kita akan melanjutkan tour hari ini diawali dengan menuju Gunung Fuji sampai 5th Station (Jika cuaca mendukung), yang merupakan gunung terindah dan tertinggi di Jepang. Dilanjutkan menuju Oshino Hakkai Village dan Iyashino Sato Nenba disini kita dapat melihat rumah traditional Jepang dengan Jerami dan anyaman bambu sebagai atap dan dindingnya. Di lanjutkan menuju Lake Kawaguchi. Check-in Hotel. disini kita dapat menikmati onsen dan makan malam  dengan Yukata (Baju Tradisional Jepang) dihotel istirahat.\r\nBermalam di Kawaguchiko Jiragon Hotel*** or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:31:\"Lake Kawaguchi - Hakone - Tokyo\";s:9:\"deskripsi\";s:557:\"Setelah sarapan pagi, kita akan mengunju Hakone untuk mengunjungi Arakurayama Sengen Park disini kita dapat melihat Chureito Pagoda yang merupakan monument perdamaian,.Setelah itu mengujungi Owakudahi Hell Valley, Merupakan tempat yang terkenal dari uap mendidih yang muncul dari gunung dan juga memiliki pemandangan indah dan Telur Hitam yang disebut Kurotamago. Selanjutnya kita akan menikmati keindahan alam danau Ashi dengan Lake Ashi Cruise. Kemudian Kembali ke Tokyo. Check-in hotel istirahat. \r\nBermalam di Tmark City Hotel Tokyo Omori***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:25:\"Tokyo - Yokohama - Odaiba\";s:9:\"deskripsi\";s:506:\"Setelah sarapan pagi, kita akan melanjutkan tour hari ini diawali dengan mengunjungi Ramen Museum, kemudian dilanjutkan menuju Yokohama Chinatown yang merupakan Chinatown terbesar di Jepang dan dilanjutkan berbelanja di Motomachi Shopping Arcade. Kemudian kita menuju Odaiba untuk berbelanja dan disini kita dapat berfoto di Giant Guandam Statue (photostop). Dilanjutkan menuju Shibuya tempat dimana patung Hachiko berada. Check-in hotel istirahat. \r\nBermalam di Tmark City Hotel Tokyo Omori***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:5:\"Tokyo\";s:9:\"deskripsi\";s:272:\"Setelah santap pagi, kita akan menuju Tokyo DisneySea yang merupakan taman hiburan Disney pertama yang dibangun di luar Amerika Serikat. (Termasuk One Day Pass) dengan pengalaman menggunakan subway. Check in hotel istirahat.\r\nBermalam di T-mark Omori Hotel ***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:15:\"Tokyo - Jakarta\";s:9:\"deskripsi\";s:160:\"Setelah santap pagi, kita memiliki waktu bebas sebelum melanjutkan perjalanan pulang ke tanah air. Sampai jumpa di perjalanan menyenang bersama kami berikutnya.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}}', 'Tiket International Jakarta-Tokyo PP dengan GARUDA INDONESIA, Economy termasuk seluruh taxes(Tiket Grup Fixed Date & No Extend) \r\n Bagasi sesuai dengan ketentuan Airlines\r\nAkomodasi hotel *3 atau *4 setaraf (Twin / Triple)\r\nTransportasi bus Pariwisata & tiket masuk objek wisata\r\nAcara Tour &makan sesuai program paket tour diatas\r\nMineral Water 01 Botol Perhari\r\nTour Leader \r\nTravel asuransi sampai usia 69 tahun\r\nLuggage Tag', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:18:\"VISA SINGLE JEPANG\";s:14:\"exclusion_rate\";s:6:\"800000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:11:\"Visa Waiver\";s:14:\"exclusion_rate\";s:6:\"275000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:19:\"Modem Wifi Portable\";s:14:\"exclusion_rate\";s:6:\"490000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:3;a:3:{s:9:\"exclusion\";s:34:\"TIPPING TOUR LEADER, GUIDE, DRIVER\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}}', NULL, '7D TOKYO IED MUBARAK WITH ONSEN EXPERIENCE + TOKYO DISNEYSEA (GA)(1).docx', 'Japan'),
(74, '2023-10-20 14:29:59', '2023-11-07 16:01:37', '7D SUPER SALE SPRING LEBARAN HOLIDAY GOLDEN ROUTE JAPAN + TDS + USJ', '7DS3LHGRJ - TDSUSJ', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:15:\"Jakarta - Osaka\";s:9:\"deskripsi\";s:128:\"Malam ini kita berkumpul di bandara Seokarno-Hatta untuk berangkat menuju ke Osaka dengan Premium Airlines.\r\nBermalam di pesawat\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:141:\"CGK (12.15) – KUL (15.25) by MH716  atau CGK (16.05) – KUL (19.25) by MH720 & KUL (22.15) – KIX (05.45)+1 by MH052 => Malaysia Airlines\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:5:\"Osaka\";s:9:\"deskripsi\";s:749:\"Setelah sampai di Jepang, kita akan disambut guide yang ramah, setelah itu anda akan langsung diajak untuk mengunjungi tempat pembuatan film yang terbesar dan termegah dunia di Osaka yaitu Universal Studios Japan dengan shownya seperti Super Nintendo World, Despicable Me Minion Mayhem, The Wizarding World of Harry Potter, The Amazing Adventure Of Spider-Man: The Ride, Hollywood Dream: The Ride, Water World Show, The Terminator 2 (3D), Shrek’s (4D) Adventure/ Sesame Street – Movie Magic, E.T Adventure, Snoopy’s Playland, Jurassic Park, dll. Setelah itu Anda berkesempatan untuk berbelanja di salah satu pusat perbelanjaan terkenal di kota Osaka yaitu Shinsaibashi. Check-in hotel istirahat.\r\nBermalam di Osaka Plaza Hotel ****  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:25:\"Osaka - Kyoto - Toyohashi\";s:9:\"deskripsi\";s:469:\"Setelah santap pagi, kita akan menuju Kyoto untuk mengunjungi Kiyomizu Temple yang merupakan kuil Budha kuno yang dibangun sejak tahun 798 dan mengalami 10 kali kerusakan akibat perang dan bencana alam. Kemudian kita akan menuju Fushimi Inari Taisha yang merupakan kuil Shinto dan juga kuil pusat bagi sekitar 40.000 kuil Inari yang memuliakan Inari. Selanjutnya kita akan menuju Toyohashi. Check-in hotel istirahat.\r\nBermalam di Loisir Hotel Toyohashi ****  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:20:\"Toyohashi - Mt. Fuji\";s:9:\"deskripsi\";s:464:\"Setelah santap pagi, kita akan mengunjungi Gunung Fuji yang merupakan gunung terindah dan tertinggi di Jepang, dengan menggunakan Bullet train dari Toyohasi Tohamamatsu (1 stop) sampai 5th Station (Jika cuaca mendukung). Di perjalanan kita juga akan berbelanja di premium outlet terbesar di Jepang, Gotemba Premium Outlet, disini anda dapat berbelanja berbagai macam brand ternama. Check-in hotel istirahat.\r\nBermalam di Jiragonno Fuji Yakata Hotel ***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:5:\"Tokyo\";s:9:\"deskripsi\";s:743:\"Setelah santap pagi, kita akan mengunjungi Fuji Shibazakura park atau dapat digantikan dengan Oshino Hakkai, jika kondisi tidak memungkinkan. Hari ini kita akan juga mengunjungi Asakusa Kannon Temple atau yang dilebih dikenal dengan Sensoji merupakan salah satu kuil yang paling populer. dilanjutkan melewati Imperial Palace yang merupakan kompleks Istana tempat kediaman kaisar Jepang. Kemudian Anda juga akan diajak photostop dengan background Tokyo Sky Tree (Photostop) yang merupakan menara tertinggi kedua didunia(634m). kita juga akan mengunjungi Shibuya, distrik perbelanjaan terkemuka di Jepang disini terdapat ikon dengan monumen Hachiko yang sangat terkenal sebagai anjing yang setia. \r\nBermalam di T mark Omori Hotel ***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:20:\"Tokyo - Kuala Lumpur\";s:9:\"deskripsi\";s:280:\"Setelah santap pagi, kita hari ini akan mengunjungi Tokyo Disney Sea (Termasuk One Day Pass), pusat permainan terbesar dan banyak wahana dan pemandangan yang menarik, setelah itu di malam hari kita akan di antarkan ke airport untuk kembali ke  kampung halaman\r\nBermalam di pesawat\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:38:\"NRT (22.30)  – KUL (04.55)  by MH071\";}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:22:\"Kuala Lumpur - Jakarta\";s:9:\"deskripsi\";s:156:\"Hari ini kita akan melanjutkan untuk perjalanan kembali ke bandara Soekarno Hatta Jakarta.  Sampai jumpa di perjalanan menyenangkan bersama kami berikutnya.\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}}', 'Tiket International Jakarta-Osaka/ Narita-Jakarta dengan Malaysia Airlines, Economy termasuk seluruh taxes(Tiket Grup Fixed Date & No Extend)  Bagasi 30 kg per orang atau sesuai dengan ketentuan AirlinesAkomodasi hotel *3/*4 setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour &makan sesuai program paket tour diatasMineral Water 01 Botol PerhariTour Leader Travel asuransiLugage Tag', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:18:\"VISA SINGLE JEPANG\";s:14:\"exclusion_rate\";s:6:\"800000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:11:\"Visa Waiver\";s:14:\"exclusion_rate\";s:6:\"275000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:34:\"Tipping Guide, Driver, Tour Leader\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:3;a:3:{s:9:\"exclusion\";s:10:\"Modem Wifi\";s:14:\"exclusion_rate\";s:6:\"490000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, 'SUPER SALE SPRING LEBARAN HOLIDAY GOLDEN ROUTE JAPAN 7D WITH TOKYO DISNEY SEA+UNIVERSAL STUDIO  (1).docx', 'Japan'),
