(89, '2023-10-31 13:51:00', '2023-10-31 13:51:00', '8D SUPER WINTER NEW YEAR HOLIDAY KOREA + EVERLAND', '8DSPWNYEVD', 'a:8:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:17:\"Jakarta - Incheon\";s:9:\"deskripsi\";s:161:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Incheon Maskapai  Premium Garuda Indonesia.\r\nBermalam di PESAWAT\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:58:\"CGK (23.15) -ICN (08.30)+1DAY  by GA878=> Garuda Indonesia\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:33:\"INCHEON  - NAMI ISLAND - MT SORAK\";s:9:\"deskripsi\";s:424:\"Setiba di Incheon disambut Guide berbahasa Indonesia yang ramah, kita akan menuju Ski Resort (exclude ski equipment & clothes), panorama winter di Korea yang indah. Kemudian, kita akan mengunjungi menuju Nami Island yang merupakan tempat syuting “Winter Sonata” serial drama Korea yang mendunia. Kemudian Dilanjutkan menuju Mt Sorak.  Setelah itu, Check in hotel istirahat. \r\nBermalam di Sorak For You Resort ***/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:23:\"SUWON - SEOUL CITY TOUR\";s:9:\"deskripsi\";s:407:\"Sarapan pagi di hotel. Lalu kita akan tour mengunjungi Gwangumsung Fortress Hill(termasuk cable car) , Great Bronze Buddha  Statue, Sinheungsa Temple. . Dilanjutkan menuju Suwon, Setelah itu kita akan mengunjungi Mr. Toilet Museum Suwon. Disini kita akan mengunjungi situs kerajaan yang dilindungi UNESCO, yaitu Suwon Hwaseong Fortress. Check in hotel istirahat. \r\nBermalam di JK Blossom Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:23:\"SUWON - SEOUL CITY TOUR\";s:9:\"deskripsi\";s:416:\"Sarapan pagi di hotel, hari ini kita akan memiliki kesempatan mengunjungi dan bermain di taman hiburan Everland, merupakan taman hiburan terbesar di Korea. Dilanjutkan N Seoul Tower & Love Lock,(silahkan letakkan gembok cinta anda disini)dan Donuimun Museum Village. Kita akan menuju hiKR Ground, disini kitab isa berfoto-foto Bagai artis Korea. Check in hotel istirahat. \r\nBermalam di JK Blossom Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:15:\"SEOUL CITY TOUR\";s:9:\"deskripsi\";s:384:\"Setelah santap pagi, kita akan mengunjungi National Gingseng Museum, dilanjutkan ke K-Cosmetic Shop, kemudian kita akan melewati Blue House dan mengunjungi Gyeongbokgung Palace & National Folk Village. Dilanjutkan menuju Bukchon Hanok Village.  Melewati  Cheonggyecheon Stream, Dilanjutkan shopping di Dongdaemun. Check in hotel istirahat. \r\nBermalam di JK Blossom Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:15:\"SEOUL CITY TOUR\";s:9:\"deskripsi\";s:646:\"Setelah Santap pagi. Kita akan mengunjungi Health Care Shop (Red Pine Tree), Amethyst Show case. Dilanjutkan menuju Itaewon Mosque dan dapat shalat sejenak di masjid terkenal di Korea, bagi yang non muslim dapat mengunjungi b jalanan Itaewon yang sangat terkenal pada drama “Itaewon Class”, yaitu Noksapyeong Street. Setelah itu bagi penggemar K-Pop kita akan mengunjungi pusat K-Pop, yaitu COEX Mall. Dilanjutkan menuju Lotte Tower untuk berfoto. Dilanjutkan menuju Seokchon Lake Park yang merupakan taman danau yang mencangkup danau seokchon dan pulau Ajaib dunia lotte. Check-in hotel istirahat.\r\nBermalam di JK Blossom Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:15:\"SEOUL CITY TOUR\";s:9:\"deskripsi\";s:419:\"Setelah santap pagi, kita akan mengunjungi Insadong Antique Street dan Hongdae Street. Kita juga dapat membuat makanan traditional Korea Selatan yaitu kimchi di Making Kimbap & Hanbok dan berfoto menggunakan baju Hanbok. Kemudian kita langsung menuju Duty Free Shop untuk kita dapat berbelanja oleh-oleh. Dilanjutkan shopping di Myeongdong Street. Check in hotel istirahat.  \r\nBermalam di JK Blossom Hotel *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:7;a:7:{s:4:\"hari\";s:1:\"8\";s:6:\"lokasi\";s:16:\"SEOUL  - JAKARTA\";s:9:\"deskripsi\";s:163:\"Sarapan pagi, lalu mengunjungi Local supermarket untuk berbelanja oleh-oleh sebelum ke Incheon Airport. Tiba waktunya  diantar ke Airport untuk kembali ke Jakarta,\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:55:\"ICN (10.35) - CGK (15.35)  by GA879 => Garuda Indonesia\";}}', 'Tiket International Jakarta-Incheon by Garuda Indonesia, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend)\r\n  Bagasi sesuai dengan ketentuan Airlines\r\n  Akomodasi hotel *3 setaraf (Twin / Triple)\r\n  Transportasi bus Pariwisata & tiket masuk objek wisata\r\n  Acara Tour & makan sesuai program paket tour diatas\r\n  Mineral Water 01 Botol Perhari\r\n  Tour Leader \r\n  Travel Kits (Luggage Tag)\r\n  Travel Insurance', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:16:\"VISA GROUP KOREA\";s:14:\"exclusion_rate\";s:6:\"625000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:1;a:3:{s:9:\"exclusion\";s:19:\"Modem Wifi Portable\";s:14:\"exclusion_rate\";s:6:\"560000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:17:\"VISA SINGLE KOREA\";s:14:\"exclusion_rate\";s:6:\"980000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:3;a:3:{s:9:\"exclusion\";s:34:\"TIPPING TOUR LEADER, GUIDE, DRIVER\";s:14:\"exclusion_rate\";s:6:\"920000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}}', 'WhatsApp Image 2023-10-28 at 13.07.26.jpeg', '8D6N SUPER NEW YEAR HOLIDAY KOREA + EVERLAND