(90, '2023-10-31 13:59:31', '2023-10-31 13:59:31', '8D WONDERFUL NEW YEAR KOREA + EVERLAND', '8DWNDYNEVD', 'a:8:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:17:\"JAKARTA - INCHEON\";s:9:\"deskripsi\";s:153:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Incheon Maskapai  Malaysia Airlines\r\nBermalam di PESAWAT\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:78:\"CGK (18.25) –KUL (21.35)  by MH722 & KUL (23.15) – ICN (06.30)  by MH66\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:32:\"INCHEON - NAMI ISLAND - MT SORAK\";s:9:\"deskripsi\";s:401:\"Setiba di Incheon disambut Guide berbahasa Indonesia yang ramah, kita akan ke Gangchon Ski Resort (Tidak termasuk pakaian dan peralatan ski). Kemudian, kita akan mengunjungi menuju Nami Island yang merupakan tempat syuting “Winter Sonata” serial drama Korea yang mendunia. Kemudian Dilanjutkan menuju Mt Sorak.  Setelah itu, Check in hotel istirahat. \r\nBermalam di Sorak For You Resort ***/similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:18:\"MT SORAK – SUWON\";s:9:\"deskripsi\";s:401:\"Sarapan pagi di hotel. Lalu kita akan tour mengunjungi Gwangumsung Fortress Hill(termasuk cable car) , Great Bronze Buddha  Statue, Sinheungsa Temple. . Dilanjutkan menuju Suwon, Setelah itu kita akan mengunjungi Mr. Toilet Museum Suwon. Disini kita akan mengunjungi situs kerajaan yang dilindungi UNESCO, yaitu Suwon Hwaseong Fortress. Check in hotel istirahat. \r\nBermalam di Park Habio *** / similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:23:\"SUWON - SEOUL CITY TOUR\";s:9:\"deskripsi\";s:410:\"Sarapan pagi di hotel, hari ini kita akan memiliki kesempatan mengunjungi dan bermain di taman hiburan Everland, merupakan taman hiburan terbesar di Korea. Dilanjutkan N Seoul Tower & Love Lock,(silahkan letakkan gembok cinta anda disini)dan Donuimun Museum Village. Kita akan menuju hiKR Ground, disini kitab isa berfoto-foto Bagai artis Korea. Check in hotel istirahat. \r\nBermalam di Park Habio *** / similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:15:\"SEOUL CITY TOUR\";s:9:\"deskripsi\";s:378:\"Setelah santap pagi, kita akan mengunjungi National Gingseng Museum, dilanjutkan ke K-Cosmetic Shop, kemudian kita akan melewati Blue House dan mengunjungi Gyeongbokgung Palace & National Folk Village. Dilanjutkan menuju Bukchon Hanok Village.  Melewati  Cheonggyecheon Stream, Dilanjutkan shopping di Dongdaemun. Check in hotel istirahat. \r\nBermalam di Park Habio *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:15:\"SEOUL CITY TOUR\";s:9:\"deskripsi\";s:680:\"Setelah Santap pagi. Kita akan mengunjungi Health Care Shop (Red Pine Tree), Amethyst Show case. Dilanjutkan menuju Itaewon Mosque dan dapat shalat sejenak di masjid terkenal di Korea, bagi yang non muslim dapat mengunjungi b jalanan Itaewon yang sangat terkenal pada drama “Itaewon Class”, yaitu Noksapyeong Street. Setelah itu bagi penggemar K-Pop kita akan mengunjungi pusat K-Pop, yaitu COEX Mall dan Gangnam Underground Shopping Center. Dilanjutkan menuju Lotte Tower untuk berfoto. Dilanjutkan menuju Seokchon Lake Park yang merupakan taman danau yang mencangkup danau seokchon dan pulau Ajaib dunia lotte. Check-in hotel istirahat.\r\nBermalam di Park Habio *** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:15:\"SEOUL CITY TOUR\";s:9:\"deskripsi\";s:413:\"Setelah santap pagi, kita akan mengunjungi Insadong Antique Street dan Hongdae Street. Kita juga dapat membuat makanan traditional Korea Selatan yaitu kimchi di Making Kimbap & H