(92, '2023-10-31 14:45:16', '2023-11-07 16:09:53', '7D WINTER SUPER SALE GOLDEN ROUTE JAPAN TOKYO AND OSAKA+UNIVERSAL STUDIO & TOKYO DISNEY SEA', '7DWSSGR', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:17:\"JAKARTA – TOKYO\";s:9:\"deskripsi\";s:139:\"Hari ini kita berkumpul di bandara Seokarno-Hatta untuk berangkat menuju ke Tokyo dengan pesawat  All Nippon Airways. \r\nBermalam di Pesawat\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:55:\"CGK (21.45) - HND (06.50)+1 by NH856 (DIRECT FLIGHT)\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:23:\"ARRIVAL-TOKYO CITY TOUR\";s:9:\"deskripsi\";s:677:\"Sesampainya di Airport Tokyo, kita akan diantar menuju hotel. kita akan langsung diajak untuk mengunjungi Asakusa Kannon Temple atau yang dilebih dikenal dengan Sensoji merupakan salah satu kuil yang paling populer. dilanjutkan melewati Imperial Palace yang merupakan kompleks Istana tempat kediaman kaisar Jepang. Kemudian Anda juga akan diajak photostop dengan background Tokyo Sky Tree (Photostop) yang merupakan menara tertinggi kedua didunia(634m). kita juga akan mengunjungi Shibuya, distrik perbelanjaan terkemuka di Jepang disini terdapat ikon dengan monumen Hachiko yang sangat terkenal sebagai anjing yang setia. \r\nBermalam di T Mark Tokyo Omori Hotel ***  or similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:16:\"TOKYO DISNEY SEA\";s:9:\"deskripsi\";s:342:\"Setelah santap pagi, kita akan menuju Tokyo DisneySea (dapat digantikan ke Tokyo DisneyLand Jika Disney Sea full) yang merupakan taman hiburan Disney pertama yang dibangun di luar Amerika Serikat. (Termasuk One Day Pass) dengan menggunakan Subway Jepang/Shuttle. Check in hotel istirahat.\r\nBermalam di T Mark Tokyo Omori Hotel ***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:17:\"MT.FUJI-KAWAGUCHI\";s:9:\"deskripsi\";s:330:\"Setelah santap pagi, kita akan mengunjungi Gunung Fuji yang merupakan gunung terindah dan tertinggi di Jepang, dengan. Di perjalanan kita juga akan berbelanja di premium outlet terbesar di Jepang, Gotemba Premium Outlet, disini anda dapat berbelanja berbagai macam brand ternama.\r\nBermalam di Crown Palace Hamamatsu***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:19:\"KAWAGUCHI – KYOTO\";s:9:\"deskripsi\";s:432:\"Setelah santap pagi, kita akan menuju Kyoto untuk mengunjungi Kiyomizu Temple yang merupakan kuil Budha kuno yang dibangun sejak tahun 798 dan mengalami 10 kali kerusakan akibat perang dan bencana alam. Kemudian kita akan menuju Fushimi Inari Taisha yang merupakan kuil Shinto dan juga kuil pusat bagi sekitar 40.000 kuil Inari yang memuliakan Inari. Check-in hotel istirahat.\r\nBermalam di Miyako Hotel Kyoto Hachioji***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:38:\"OSAKA-UNIVERSAL STUDIO JAPAN-DEPARTURE\";s:9:\"deskripsi\";s:668:\"Setelah santap pagi kita akan menuju Osaka. Hari ini kita akan mengunjungi tempat pembuatan film yang terbesar dan termegah dunia di Osaka yaitu Universal Studios Japan dengan shownya seperti Super Nintendo World, Despicable Me Minion Mayhem, The Wizarding World of Harry Potter, The Amazing Adventure Of Spider-Man: The Ride, Hollywood Dream: The Ride, Water World Show, The Terminator 2 (3D), Shrek’s (4D) Adventure/Sesame Street – Movie Magic, E.T Adventure, Snoopy’s Playland, Jurassic Park, dll. Setelah itu Anda berkesempatan untuk berbelanja di salah satu pusat perbelanjaan terkenal di kota Osaka yaitu Shinsaibashi. Setelah itu diantar menuju ke airport\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:41:\"KIX (21.10)  – HND (22.25) by NH 098\";}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:15:\"OSAKA - JAKARTA\";s:9:\"deskripsi\";s:119:\"Hari ini kita akan melanjutkan perjalanan ke Jakarta.  Sampai jumpa di perjalanan menyenangkan bersama kami berikutnya.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";s:39:\"HND (00.05) – CGK (06.00) byNH 871\";}}', 'Tiket International Jakarta-Tokyo/ Osaka-Jakarta dengan Malaysia Airlines, Economy termasuk seluruh taxes(Tiket Grup Fixed Date & No Extend)  Bagasi sesuai dengan ketentuan AirlinesAkomodasi hotel *3/*4 setaraf (Twin / Triple)Transportasi bus Pariwisata & tiket masuk objek wisataAcara Tour &makan sesuai program paket tour diatasMineral Water 01 Botol PerhariTour Leader Travel asuransiLugage Tag', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:6:\"805000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:19:\"Modem Wifi Portable\";s:14:\"exclusion_rate\";s:6:\"420000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:11:\"Visa Waiver\";s:14:\"exclusion_rate\";s:6:\"275000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:3;a:3:{s:9:\"exclusion\";s:18:\"Visa Single Jepang\";s:14:\"exclusion_rate\";s:6:\"800000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', 'SUPER SALE WINTER GOLDEN ROUTE WITH ANA 18FEB USJ+TDS (2).docx', 'SUPER SALE WINTER GOLDEN ROUTE WITH ANA 18FEB USJ+TDS.docx', 'JAPAN'),
(93, '2023-11-04 12:16:40', '2023-11-04 12:27:40', '7D SHOCKING SALE GOLDEN ROUTE JAPAN + SHIRAKAWAGO', '7DS2GRJS', 'a:7:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:18:\"JAKARTA  – OSAKA\";s:9:\"deskripsi\";s:679:\"Setelah sampai di Jepang, kita akan disambut guide yang ramah, setelah itu anda akan langsung diajak untuk mengunjungi mengunjungi Shinsaibasi – Dotonburi yang merupakan daerah pusat perbelanjaan yang iconic dengan papan iklan glico mannya. Kemudian, kita akan mengjungi Fushimi Inari yang merupakan kuil Shinto dan juga kuil pusat bagi sekitar 40.000 kuil Inari yang memuliakan Inari. Terakhir kita akan mengunjingi Kiyomizu Temple yang merupakan kuil Budha kuno yang dibangun sejak tahun 798 dan mengalami 10 kali kerusakan akibat perang dan bencana alam. Kemudian kita akan melakukan perjalanan ke Gifu, Check-in hotel istirahat\r\nBermalam di Gifu Resol Hotel ***  or similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:117:\"CGK (15.45) – KUL (18.50) by MH720 OR CGK (18.25) – KUL (21.35) by MH722 & KUL (22.40) – KIX (05.40)+1 by MH052\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:20:\"OSAKA - KYOTO - GIFU\";s:9:\"deskripsi\";s:679:\"Setelah sampai di Jepang, kita akan disambut guide yang ramah, setelah itu anda akan langsung diajak untuk mengunjungi mengunjungi Shinsaibasi – Dotonburi yang merupakan daerah pusat perbelanjaan yang iconic dengan papan iklan glico mannya. Kemudian, kita akan mengjungi Fushimi Inari yang merupakan kuil Shinto dan juga kuil pusat bagi sekitar 40.000 kuil Inari yang memuliakan Inari. Terakhir kita akan mengunjingi Kiyomizu Temple yang merupakan kuil Budha kuno yang dibangun sejak tahun 798 dan mengalami 10 kali kerusakan akibat perang dan bencana alam. Kemudian kita akan melakukan perjalanan ke Gifu, Check-in hotel istirahat\r\nBermalam di Gifu Resol Hotel ***  or similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:4