\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:14:\"TOKYO FREE DAY\";s:9:\"deskripsi\";s:145:\"Setelah santap pagi, hari ini anda dapat bebas menjelajah kota Tokyo seharian (NO BUS, NO GUIDE).\r\nBermalam di T mark Omori Hotel ***  or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:22:\"KUALA LUMPUR - JAKARTA\";s:9:\"deskripsi\";s:139:\"Hari ini kita akan melakukan perjalanan ke bandara Soekarno Hatta Jakarta. Sampai jumpa di perjalanan menyenangkan bersama kami berikutnya.\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:118:\"NRT (10.05) – KUL (17.00) by MH089  & KUL (18.05) – CGK (19.05) by MH725 OR & KUL (22.20) – CGK (23.30) by MH727\";}}', '✔	Tiket International Jakarta-Osaka/ Narita-Jakarta dengan Malaysia Airlines, Economy termasuk seluruh taxes(Tiket Grup Fixed Date & No Extend) ✔	 Bagasi 30 kg per orang atau sesuai dengan ketentuan Airlines✔	Akomodasi hotel *3/*4 setaraf (Twin / Triple)✔	Transportasi bus Pariwisata & tiket masuk objek wisata✔	Acara Tour &makan sesuai program paket tour diatas✔	Mineral Water 01 Botol Perhari✔	Tour Leader ✔	Travel Insurance  sampai usia 69 tahun✔	Lugage Tag', 'a:4:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Local Guide, Driver, Tour Leader\";s:14:\"exclusion_rate\";s:6:\"690000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:17:\"VISA SINGLE JAPAN\";s:14:\"exclusion_rate\";s:6:\"800000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:2;a:3:{s:9:\"exclusion\";s:17:\"VISA WAIVER JAPAN\";s:14:\"exclusion_rate\";s:6:\"275000\";s:14:\"exclusion_type\";s:8:\"optional\";}i:3;a:3:{s:9:\"exclusion\";s:19:\"MODEM WIFI PORTABLE\";s:14:\"exclusion_rate\";s:6:\"420000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', 'WhatsApp Image 2023-11-04 at 12.24.12.jpeg', 'SHOCKING SALE JAPAN GOLDEN ROUTE (1).docx', 'JAPAN'),
(94, '2023-11-08 10:51:54', '2023-11-09 14:58:12', '8D PANORAMIC JIUZHAIGOU+ LESHAN &EMEISHAN', '8PNJLE', 'a:8:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:18:\"JAKARTA –CHENGDU\";s:9:\"deskripsi\";s:126:\"Hari ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Chengdu. \r\nBermalam di pesawat\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:143:\"CGK (23.00) – TFU (05.20)+1 by CA-476 => Air China OR CGK (14.10) – SIN (17.05) BY SQ959& SIN(02.10) – TFU (07.00) BY SQ 844 (FREE JEWEL)\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:29:\"CHENGDU – LESHAN - EMEISHAN\";s:9:\"deskripsi\";s:517:\"Setiba pagi di Bandar Udara Chengdu Tianfu, Chengdu Province, disambut Guide yang ramah kemudian kita akan langsungperjalanan ke daerah Leshan untuk mengunjungi Leshan Buddha Statue, sebuah patung buddha yang dibuat dari pahatan batu pasir merah dan dibangun pada masa Dinasti Tang dengan adanya pecahan dari 3 sungai di bawah kakinya (Sungai Minjiang, Sungai Qingyi, dan Sungai Dadu). Kemudian peserta akan pergi menuju kota Emeishan untuk Check-in Hotel dan beristirahat. \r\nBermalam di Century Sunshine ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:23:\"EMEISHAN – DUJIANGYAN\";s:9:\"deskripsi\";s:507:\"Sarapan pagi di hotel, peserta akan mengunjungi Emeishan Culture Museum, lalu peserta menuju Baoguo Temple, sebuah kuil yang terletak di Gunung Emei, dimana terdapat 3 ajaran kepercayaan yang ada di dalamnya, seperti Buddha, Tao, dan juga Konfusianisme. Setelah itu, peserta juga akan mengunjungi Kuil Fuhu Emeishan, yang juga berdekatan lokasinya dengan Kuil Baoguo. Peserta akan melanjutkan perjalanan menuju Kota Dujiangyan. Check in hotel dan beristirahat. \r\nBermalam di Liwan Holiday Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:25:\"DUJIANGYAN – JIUZHAIGOU\";s:9:\"deskripsi\";s:691:\"Sarapan pagi di hotel, Peserta mengunjungi Songpan City Wall, sebuah tembok yang mengelilingi kota Songpan, dengan 7 pintu gerbang dan dibangun pada masa Raja pertama dinasi ming, Raja Zhu Yuanzhang berkuasa (1379 M). Tembok ini sangatlah kokoh yang dimana erosi dari angin dan air belum mampu merusak tembok ini sampai sekarang. Setelah itu, peserta pergi menuju Danau Diexi, sebuah danau yang terbentuk akibat Longsoran tanah akibat gempa pada tahun 1933 dan menenggelamkan kota tua Diexi sehingga kita masih dapat melihat beberapa spot seperti Menara pengawas, kuil, dan yang lainnya di tempat ini. Peserta akan Check in hotel dan beristirahat.\r\nBermalam di New Jiuzhai Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:10:\"JIUZHAIGOU\";s:9:\"deskripsi\";s:601:\"Sarapan pagi di hotel, peserta akan mengunjungi Jiuzhaigou National Park dengan Public Eco Bus. Taman Nasional seluas 720km2 yang mempunyai bentuk permukaan yang berbeda di wilayah Utara dengan permukaan dataran yang rendah (2000 MDPL) dan wilayah Selatannya yang punya permukaan dataran lebih tinggi (4500 MDPL). Taman nasional ini sudah diresmikan sebagai warisan alam dunia oleh UNESCO World Heritage, dan juga sebagai habitat popular untuk Giant Panda dan dengan keberagaman ekosistem di dalamnya. Setelah itu, peserta Kembali ke hotel dan beristirahat \r\nBermalam di New Jiuzhai Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:36:\"JIUZHAIGOU – HUANGLONG – MAOXIAN\";s:9:\"deskripsi\";s:426:\"Sarapan pagi di hotel, peserta akan mengunjungi HUANGLONG, Tempat situs warisan dunia dengan banyak pemandangan dan tempat wisata alam didalamnya. Tempat dengan area seluas 700km2 ini menjadi salah satu rumah untuk banyak hewan yang terancam punah seperti panda dan kera emas. Setelah itu, peserta akan melanjutkan perjalanan ke kota Maoxian, check in hotel dan beristirahat.\r\nBermalam di Westqiang Homeland Hotel ****/similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:17:\"MAOXIAN - CHENGDU\";s:9:\"deskripsi\";s:312:\"Sarapan pagi di hotel, peserta akan memulai perjalanan menuju kota Chengdu, mengunjungi Panda Base dengan Buggy Car. Dilanjutkan dengan mengunjungi Chunxi Road dan Taikooli, area yang terkenal dengan tempat untuk Shopping di wilayah kota Chengdu. \r\nBermalam di Holiday Inn Express Tianfu airport **** /or similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:7;a:7:{s:4:\"hari\";s:1:\"8\";s:6:\"lokasi\";s:18:\"CHENGDU– JAKARTA\";s:9:\"deskripsi\";s:201:\"Setelah sarapan pagi, waktu bebas sampai peserta akan diantar menuju bandara untuk penerbangan menuju Bandara International Soekarno Hatta, tour selesai dan sampai berjumpa di program tour selanjutnya.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:122:\"TFU (16.35)– CGK (21.30) By CA-475 => Air China OR TFU (08.15)- SIN(13.10) By SQ845 & SIN(16.10) – CGK(16.55) BY SQ962\";}}', 'Tiket International Jakarta-Chengdu Air China Direct Flight/ Singapore Airlines Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) ✔	Bagasi sesuai dengan ketentuan Airlines ✔	Akomodasi hotel *4 Local setaraf (Twin / Triple)✔	Transportasi bus Pariwisata & tiket masuk objek wisata✔	Acara Tour & makan sesuai program paket tour diatas✔	Mineral Water 1 Botol Perhari✔	Tour Leader ✔	Travel Kits (Luggage Tag)✔	Travel Insurance (sampai usia 69 Tahun)', 'a:3:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\