(95, '2023-11-08 11:38:34', '2023-11-09 14:58:46', '10D SUPER SALE NEW YEAR CHINA HUADONG-SHANGHAI', 'SCHS10', 'a:10:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:20:\"JAKARTA – SHANGHAI\";s:9:\"deskripsi\";s:131:\"Malam ini kita berkumpul di Bandara Soekarno-Hatta terminal 3 Ultimate untuk berangkat menuju ke Shanghai Singapore Airlines Group.\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:77:\"✈︎ CGK (20.00) – SIN (23.00) by TR279  Include Meals dan Bagasi Connect\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:19:\"SHANGHAI - HANGZHOU\";s:9:\"deskripsi\";s:681:\"Hari ini kita telah sampai di Shanghai, dan kita akan disambut oleh Guide dan langsung menuju West Lake (include boat) yang merupakan destinasi wisata yang telah diakui oleh UNESCO akan keindahan alam dan kekayaan budayanya di sini kita akan diajak mengelilingi danau menggunakan boat. Setelah puas mengunjungi West Lake, kita akan mengunjungi Yu Fei Temple yaitu kuil yang didedikasikan untuk menghormati dan mengenang Jenderal Yu Fei. Selesai dari Yu Fei Temple, kita akan menuju Sudi yaitu jalanan yang menghubungkan bagian selatan dan utara West Lake. Kita dapat berjalan santai dan menikmati pemandangan. Check-in Hotel.\r\nBermalam di Liangan International Hotel **** / similar\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";s:43:\"✈︎ SIN (01.15) – PVG (06.30) by SQ826\";}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:15:\"HANGZHOU - WUXI\";s:9:\"deskripsi\";s:458:\"Sarapan pagi di hotel. Kita akan mengunjungi Tea Garden. Setelah itu kita akan menuju Nanxun Ancient Water Town (include boat), di sana kita akan mengelilingin kota air tua Nanxung menggunakan boat. Selesai mengelilingin Nanxun, kita akan mengunjungin Nanchang Street yang merupakan destinasi hiburan dan terletak di kota Wuxi denga berbagai macam toko yang ada. Selesai dari Nanchang Street kita akan Check-in Hotel.\r\nBermalam di Mingdu Hotel **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:14:\"WUXI CITY TOUR\";s:9:\"deskripsi\";s:466:\"Sarapan pagi di hotel. Lalu kita akan langsung menuju Teapot di sana kita dapat berbelanja tea pot dan berswafoto dengan monument Teapot besar di sana. Setelah puas berswafoto, kita akan menuju Three Kingdoms City (termasuk buggy) yang terletak di kota Wuxi dan akan mengelilingi destinasi tersebut menggunakan buggy. Selesai dari Three Kingdoms City, kita akan menikmati Night View of Suffrage Bay. Kemudian, Check-in Hotel.\r\nBermalam di Mingdu Hotel **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:13:\"WUXI - SUZHOU\";s:9:\"deskripsi\";s:379:\"Sarapan pagi di hotel. Kita akan berbelanja di Pearl Shop Wuxi, kemudian menuju Suzhou untuk mengunjungi Couples Retreat Garden (termasuk boat) atau yang disebut dengan Ou Yuan Garden terkenal dengan Taman yang bertemakan khas China zaman dulu, dilanjutkan menuju Jinji Lake, dan menikmati pemandangan malam hari di sana. Check-in Hotel. \r\nBermalam di Suyuan Hotel **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:19:\"SUZHOU – SHANGHAI\";s:9:\"deskripsi\";s:422:\"Sarapan pagi di hotel. Kita akan berbelanja di Silk Market. Kemudian menuju Jade Buddha Temple yaitu kuil yang terkenal akan dua buah patung Buddha yang terbuat dari batu giok putih. Setelah dari Jade Buddha Temple, kita akan menuju Starbucks Roastery Shanghai yang merupakan salah satu starbucks terbesar di dunia. Kemudian kita akan Check-in Hotel.\r\nBermalam di Metropolo Jinjiang Hotel (Shanghai Minhang) **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";N;s:6:\"flight\";N;}i:6;a:7:{s:4:\"hari\";s:1:\"7\";s:6:\"lokasi\";s:18:\"SHANGHAI CITY TOUR\";s:9:\"deskripsi\";s:402:\"Sarapan pagi di hotel. Kita akan mengunjungi dan berbelanja Medicine Store. Setelah dari Medicine Store, kita akan mengunjungi Shanghai International Finance Centre. Selesai dari Shanghai International Finance Centre, kita akan menuju ke The Oriental Pearl Tower 2 Ball. Selesai mengunjungi Pearl Tower kita akan kembali ke Hotel.\r\nBermalam di Metropolo Jinjiang Hotel (Shanghai Minhang) **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:7;a:7:{s:4:\"hari\";s:1:\"8\";s:6:\"lokasi\";s:19:\": SHANGHAI FREE DAY\";s:9:\"deskripsi\";s:237:\"Sarapan pagi di hotel. Hari ini kita ada waktu bebas kemanapun kita mau berpergian, kita bisa mengunjungi Shanghai Disneyland tanpa didampingi guide dan tour leader.\r\nBermalam di Metropolo Jinjiang Hotel (Shanghai Minhang) **** / similar\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:8;a:7:{s:4:\"hari\";s:1:\"9\";s:6:\"lokasi\";s:30:\"SHANGHAI – SUZHOU - SHANGHAI\";s:9:\"deskripsi\";s:235:\"Sarapan pagi di hotel. Kita akan berbelanja di Jewellery Shop, kemudian kita akan menuju ke pusat perbelanjaan Florentia Village Shanghai. Dilanjutkan perjalanan ke menuju airport dengan transit di Singapore sebelum kembali ke Jakarta.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:9;a:7:{s:4:\"hari\";s:2:\"10\";s:6:\"lokasi\";s:20:\"SHANGHAI - DEPARTURE\";s:9:\"deskripsi\";s:67:\"Tiba ditanah air dan sampai jumpa di tour selanjutnya bersama kami.\";s:9:\"breakfast\";N;s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:123:\"✈︎ PVG (00:10) – SIN (06:00)  by SQ825 & ✈︎ SIN (09:50) – CGK (10:35) by TR276 Include Meals dan Bagasi Connect\";}}', 'Tiket International by Singapore Airlines Group (SQ&TR), Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) ✔	Bagasi 25 kg dan meals sesuai dengan ketentuan Airlines ✔	Akomodasi hotel *4 lokal atau setaraf (Twin / Triple)✔	Transportasi bus Pariwisata & tiket masuk objek wisata✔	Acara Tour & makan sesuai program paket tour diatas✔	Mineral Water 01 Botol Perhari✔	Tour Leader✔	Travel Kits (Luggage Tag)✔	Travel Insurance sampai usia 84 tahun', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Tour Leader, Local Guide, Driver\";s:14:\"exclusion_rate\";s:7:\"1000000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:16:\"Visa Group China\";s:14:\"exclusion_rate\";s:7:\"1000000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', NULL, 'SUPERSALE NEW YEAR CHINA HUADONG SHANGHAI by SQ GRP 24DEC (1).docx', 'CHINA'),
(96, '2023-11-28 14:12:19', '2023-11-28 14:12:19', '6D LEBARAN SPECIAL SONGKRAN BANGKOK-PATTAYA', '6DLSSBPP', 'a:6:{i:0;a:7:{s:4:\"hari\";s:1:\"1\";s:6:\"lokasi\";s:15:\"Jakarta-Bangkok\";s:9:\"deskripsi\";s:369:\"Hari ini kita akan berkumpul di Bandara Internasional Soekarno Hatta (2,5 Jam sebelum keberangkatan), untuk memulai perjalanan kita ke Bangkok. Setibanya di Bangkok, proses imigrasi dan bagasi. Kita akan makan malam di restoran lokal kemudian dilanjutkan mengunjungi Jodd Fair Night Market. Check-in hotel dan bermalam di Bangkok.\r\nMenginap di Madison Hotel ***/setaraf\";s:9:\"breakfast\";N;s:5:\"lunch\";N;s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:74:\"CGK (11.10 ) - KUL (14.20) by MH 710 & KUL (17.45) - BKK (18.55) by MH 780\";}i:1;a:7:{s:4:\"hari\";s:1:\"2\";s:6:\"lokasi\";s:17:\"Bangkok - Pattaya\";s:9:\"deskripsi\";s:342:\"Setelah sarapan pagi. Kita akan menuju Pattaya dengan perjalanan selama 2 jam. Setibanya di Pattaya kita akan mengunjungi Nongnooch Village. Santap siang. Kemudian kita akan melanjutkan perjalanan ke Laser Buddha, Honey Shop. Santap malam di restoran lokal. Check-in hotel dan bermalam di Pattaya.\r\nMenginap di Baron Beach Pattaya ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:2;a:7:{s:4:\"hari\";s:1:\"3\";s:6:\"lokasi\";s:7:\"PATTAYA\";s:9:\"deskripsi\";s:258:\"Setelah sarapan pagi. Kita akan mengunjungi Erawadee Shop, Pattaya Floating Market. Santap siang di restoran lokal. melanjutkan perjalanan ke Art In Paradise. Santap malam. kemudian kembali ke hotel. Bermalam di Pattaya\r\nMenginap di Madison Hotel ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";N;s:6:\"dinner\";N;s:6:\"flight\";N;}i:3;a:7:{s:4:\"hari\";s:1:\"4\";s:6:\"lokasi\";s:17:\"Pattaya - Bangkok\";s:9:\"deskripsi\";s:375:\"Setelah sarapan pagi, kita akan mengunjungi Pattaya Beach, Gems Factory. Santap siang di restoran lokal kemudian melanjutkan perjalanan kembali ke Bangkok, perjalanan ditempuh selama 2 jam. Sebelum santap malam kita akan berbelanja di Dried Food, dilanjutkan menuju Asiatique Riverfront, kemudian check-in hotel dan bermalam di Bangkok.\r\nMenginap di Madison Hotel ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:4;a:7:{s:4:\"hari\";s:1:\"5\";s:6:\"lokasi\";s:7:\"Bangkok\";s:9:\"deskripsi\";s:446:\"Setelah sarapan pagi. kita akan mengunjungi Wat Pho (Reclining Buddha). kemudian menuju Wat Arun dan Chaophraya River dengan menaiki private boat. Santap siang. Melanjutkan perjalanan ke Platinum Mall, MBK Mall, Santap malam di restoran lokal. Hari ini kita akan diantarkan ke Khaosan Road Untuk mengikuti Songkran Festival(Khusus keberangkatan 9-13April). Setelah itu kembali ke Hotel. Bermalam di Bangkok.\r\nMenginap di Madison Hotel ***/setaraf\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";N;}i:5;a:7:{s:4:\"hari\";s:1:\"6\";s:6:\"lokasi\";s:38:\"Bangkok-Jakarta (Transit Kuala Lumpur)\";s:9:\"deskripsi\";s:230:\"Setelah sarapan pagi, Hari ini kita mendapatkan waktu bebas sampai waktu diantar ke bandara untuk perjalanan menuju Bandar Udara Internasional Suvarnabhumi untuk kembali ke Jakarta dengan  . Sampai jumpa di perjalanan selanjutnya.\";s:9:\"breakfast\";s:9:\"breakfast\";s:5:\"lunch\";s:5:\"lunch\";s:6:\"dinner\";s:6:\"dinner\";s:6:\"flight\";s:74:\"BKK (11.05 ) - KUL (14.15) by MH 785 & KUL (17.50) - CGK (19.05) by MH 725\";}}', '●	Tiket International Jakarta-Bangkok by Malaysia Airlines, Economy termasuk taxes internasional (Tiket Grup Fixed Date & No Extend) \r\n●	Bagasi sesuai dengan ketentuan Airlines (30Kg)\r\n●	Akomodasi *3 setaraf (Twin / Triple)\r\n●	Transportasi bus Pariwisata & tiket masuk objek wisata\r\n●	Acara Tour & makan sesuai program paket tour diatas\r\n●	Mineral Water 1 Botol Perhari\r\n●	Tour Leader \r\n●	Travel Kits (Luggage Tag)\r\n●	Travel Insurance', 'a:2:{i:0;a:3:{s:9:\"exclusion\";s:40:\"Tipping Local Guide, Driver, Tour Leader\";s:14:\"exclusion_rate\";s:6:\"600000\";s:14:\"exclusion_type\";s:9:\"mandatory\";}i:1;a:3:{s:9:\"exclusion\";s:8:\"SIM CARD\";s:14:\"exclusion_rate\";s:6:\"200000\";s:14:\"exclusion_type\";s:8:\"optional\";}}', 'WhatsApp Image 2023-11-28 at 13.26.35.jpeg', '6D5N LEBARAN SONGKRAN BANGKOK PATTAYA BY MH 2024.docx', 'THAILAND');
